  {video_id: "Om_2BeSwWs8", title: "Introduction to WordPress Security - PHPConf.Asia 2015", published_at: "2015-10-06 10:17:38", description: "Speaker: Stéphane Boisvert (@stephboisvert)\n\nWe will go over some of the most common attack vectors in code and how to protect against them while you write or edit a theme or plugin.\n* Escaping in WordPress\n* SQL and Data sanitization\n* Current_user_can()\n* Using Nonces to protect against CSRF\n* WordPress and PHP Security Gotchas\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/Om_2BeSwWs8/default.jpg", image2: "https://i.ytimg.com/vi/Om_2BeSwWs8/mqdefault.jpg", image3: "https://i.ytimg.com/vi/Om_2BeSwWs8/hqdefault.jpg", sort_order: nil},
