  {video_id: "bqKcd2lSahE", title: "Aaron Maniam - HackerspaceSG Awesome Talks", published_at: "2015-08-19 17:16:09", description: "Speaker: Aaron Maniam\n\nAmongst many things that nourish him, Aaron is poet inspired by the solitude and beauty he finds in nature. He will be reading some of his poems, as well as sharing about his involvement in an anthology of local poetry titled From Walden to Woodlands.\n\nEvent Page: https://www.facebook.com/events/1187628311253992/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/bqKcd2lSahE/default.jpg", image2: "https://i.ytimg.com/vi/bqKcd2lSahE/mqdefault.jpg", image3: "https://i.ytimg.com/vi/bqKcd2lSahE/hqdefault.jpg", sort_order: 46},
  {video_id: "nxYgFjoJMKA", title: "Carter Emmart - HackerspaceSG Awesome Talks", published_at: "2015-08-19 17:16:06", description: "Speaker: Carter Emmart\n\nCarter is the Director of Astrovisualization at the American Museum of Natural History. He is a storyteller, weaving together the knowledge that science uncovers about our universe and the technicalities of visualisation to create immersive experiences. He is also heading up the development of a 3D atlas called The Digital Universe. Sit tight as he takes us on a trip round our universe!\n\nEvent Page: https://www.facebook.com/events/1187628311253992/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/nxYgFjoJMKA/default.jpg", image2: "https://i.ytimg.com/vi/nxYgFjoJMKA/mqdefault.jpg", image3: "https://i.ytimg.com/vi/nxYgFjoJMKA/hqdefault.jpg", sort_order: 47},
