  {video_id: "y98dERkXa9A", title: "Interactive rebasing with Git - Grumpy Gits Meetup", published_at: "2015-05-24 13:17:31", description: "Speaker: Jason Chionh\n\nIn this short talk, we'll go through the command \"git rebase -i\". This is git rebasing in interactive mode. You can use it to organize local commit history. Specifically, we'll look at squashing many commits into one commit and re-ordering commits.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/y98dERkXa9A/default.jpg", image2: "https://i.ytimg.com/vi/y98dERkXa9A/mqdefault.jpg", image3: "https://i.ytimg.com/vi/y98dERkXa9A/hqdefault.jpg", sort_order: 134},
  {video_id: "zGA_ByAxFW8", title: "Three Python tips - PythonSG Meetup", published_at: "2015-03-26 15:55:14", description: "Speaker: Martin Brochhaus\n\nWe are hoping to repeat this talk with different speakers at the end of each meetup. Martin will make the start and give quick introductions to three basic Python tools that will make your life easier:\n\n* Virtualenv\n\n* Virtualenvwrapper\n\n* Flake8\n\nMartin is the founder of Bitmazk Pte. Ltd., a Singapore based web development agency specialized on creating web apps with Python and Django. He is also part of the organizing committee for PyCon Singapore and an active member of Python User Group Singapore.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/zGA_ByAxFW8/default.jpg", image2: "https://i.ytimg.com/vi/zGA_ByAxFW8/mqdefault.jpg", image3: "https://i.ytimg.com/vi/zGA_ByAxFW8/hqdefault.jpg", sort_order: 198},
  {video_id: "k99HSHQDsi4", title: "Getting started with testing using Pytest and Mock - PythonSG Meetup", published_at: "2015-03-26 15:54:40", description: "Speaker: Gabe Hollombe, Neo Innovation\n\nPytest is a great alternative testing framework to unittest from the standard library. It often lets you get the same tests written with far fewer lines of code, and it has a cool dependency injection system to help you share common test dependencies while keeping your tests understandable.  I'll tell you all about how to get basic unit testing done, and I'll show you how to use Voidspace's Mock library to test collaborations between your objects, too.\n\nGabe is a full-stack senior engineer at Neo Innovation, with a thirst for knowledge and a passion for sharing what he's learned. He's had the pleasure of speaking on four different continents about JavaScript, Ruby, Vim, and HTML5 Game development. \n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/k99HSHQDsi4/default.jpg", image2: "https://i.ytimg.com/vi/k99HSHQDsi4/mqdefault.jpg", image3: "https://i.ytimg.com/vi/k99HSHQDsi4/hqdefault.jpg", sort_order: 201},
