  {video_id: "sWecInli7GM", title: "Cedric Honnet - Creative Coding Meetup: Three of Pentacles", published_at: "2015-04-13 16:42:52", description: "Cedric Honnet http://www.hackster.io/cedric spent most of his life tinkering with music and computers. He studied engineering but kept exploring arts and interactivity. Cedric will share some of the tricks he discovered while collaborating with artists in France, Colombia, California and in Singapore.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/sWecInli7GM/default.jpg", image2: "https://i.ytimg.com/vi/sWecInli7GM/mqdefault.jpg", image3: "https://i.ytimg.com/vi/sWecInli7GM/hqdefault.jpg", sort_order: 180},
  {video_id: "yRynX4N3rog", title: "Developing real time applications in Django with Websockets - PythonSG Meetup", published_at: "2015-03-26 15:54:50", description: "Speaker: Gerald Goh \n\nUtilising swampdragon, I'll be showing how to build a simple real time chat application in Django. \n\nGerald is a full stack developer at Apvera Pte. Ltd., a security analytics startup.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/yRynX4N3rog/default.jpg", image2: "https://i.ytimg.com/vi/yRynX4N3rog/mqdefault.jpg", image3: "https://i.ytimg.com/vi/yRynX4N3rog/hqdefault.jpg", sort_order: 200},
  {video_id: "A4f-WFI8rbU", title: "Once upon a time there was an API - PHPConf.Asia 2015", published_at: "2015-10-06 15:05:34", description: "Speaker: Steven Cooper (@developersteve)\n\nEver wanted to know the basics of how the PayPal and Braintree API’s and SDK’s work, and how they can be integrated into your code. In this session i will cover all of the PayPal and Braintree API’s and how they can be integrated. Come see how we can not only integrate but also deal with debugging.\n\nJust to be a little different (and possibly a world first) this will be done with the help of a creatively written fairy tale and with the help of actors, yes actors, who will play the part of the various stages of the API calls from retrieving the token from the PayPal server to the completion of the transaction.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/A4f-WFI8rbU/default.jpg", image2: "https://i.ytimg.com/vi/A4f-WFI8rbU/mqdefault.jpg", image3: "https://i.ytimg.com/vi/A4f-WFI8rbU/hqdefault.jpg", sort_order: nil},
