  {video_id: "ja98ZmZ0APs", title: "Opening Keynote - PyCon SG 2015", published_at: "2015-07-12 06:08:09", description: "Speaker: Lynn Root\n\nAn insomniac software engineer for Spotify, founder of the San Francisco Chapter of PyLadies, board member of the Python Software Foundation, and member of the Django Software Foundation.\n\nSlides: https://speakerdeck.com/roguelynn/spotlight-python\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/ja98ZmZ0APs/default.jpg", image2: "https://i.ytimg.com/vi/ja98ZmZ0APs/mqdefault.jpg", image3: "https://i.ytimg.com/vi/ja98ZmZ0APs/hqdefault.jpg", sort_order: nil},
