  {video_id: "2HM_nPfKH_k", title: "Transformation of Healthcare - Singapore Futurists Meetup: Future of Health", published_at: "2015-04-12 09:56:55", description: "Speaker: Julien de Salaberry\n\nJulien is the founder of The Propell Group and has over 15 years of experience in healthcare with leading brands such as Eli Lilly, Boston Scientific, Baxter, GSK, and Merck & Co. He is also an advisor to startups and incubators in healthcare & technology in emerging high growth markets, as well as being a private investor in early stage and promising SMEs. He has recently co-written iDisrupted (published Nov 2014), which focuses on creating an understanding of the significant technological changes that are just beginning to reshape our daily lives. He is also, together with his partners, currently launching HealthStartups Asia, which aims to create greater momentum in the Asia healthtech space by raising the visibility of exciting new startups which have set out to transform health services by leveraging digital technology in the Asia-Pacific markets. Julien will provide a deeper look into the digital health space, in particular how sensors, algorithms and data are transforming healthcare.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/2HM_nPfKH_k/default.jpg", image2: "https://i.ytimg.com/vi/2HM_nPfKH_k/mqdefault.jpg", image3: "https://i.ytimg.com/vi/2HM_nPfKH_k/hqdefault.jpg", sort_order: 181},
  {video_id: "j33xvb4nF7I", title: "What is Wrong with Healthcare - Singapore Futurists Meetup: Future of Health", published_at: "2015-04-12 09:42:23", description: "Speaker: Balaji Venkatesan\n\nBalaji Venkatesan is currently heading product development for Zuellig Pharma Patient solutions. He is a staunch believer in the transformational nature of technology. Transformation of individuals and organizations are his key areas of interest. He has over 20 years of experience in business and technology. He is constantly looking for new ways in which technology can benefit businesses and individuals. He is also an active participant in the QS, Futurists & other tech groups. In this talk, Balaji will give a view into the many areas in which exponential technology is revolutionizing healthcare.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/j33xvb4nF7I/default.jpg", image2: "https://i.ytimg.com/vi/j33xvb4nF7I/mqdefault.jpg", image3: "https://i.ytimg.com/vi/j33xvb4nF7I/hqdefault.jpg", sort_order: 182},
