  {video_id: "6DtbJvIBByc", title: "July 2014 Meetup - Raspberry Pi & PHP", published_at: "2014-08-03 11:22:22", description: "Introduction to Raspberry Pi and the fun PHP projects you can try with it.\n\nThe slides: https://speakerdeck.com/miccheng/raspberry-pi-and-php\n\nProduced by Engineers.sg", image1: "https://i.ytimg.com/vi/6DtbJvIBByc/default.jpg", image2: "https://i.ytimg.com/vi/6DtbJvIBByc/mqdefault.jpg", image3: "https://i.ytimg.com/vi/6DtbJvIBByc/hqdefault.jpg", sort_order: 320},
  {video_id: "XWm02dbaJTY", title: "Concurrent Computations on Multicore Processors - PyCon SG 2015", published_at: "2015-07-11 11:16:34", description: "Speaker: Christian Zielinski\n\nIn this talk we will discuss the 'multiprocessing' module, which allows parallel programming on multicore processors. We will do a comparison with the 'threading' module, then cover the core functionality and finally discuss applications and limitations.\n\nhttps://pycon.sg/schedule/presentation/54/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/XWm02dbaJTY/default.jpg", image2: "https://i.ytimg.com/vi/XWm02dbaJTY/mqdefault.jpg", image3: "https://i.ytimg.com/vi/XWm02dbaJTY/hqdefault.jpg", sort_order: nil},
  {video_id: "PyaX7gIlnkM", title: "Decorators Demystified - PyCon SG 2015", published_at: "2015-07-11 11:17:49", description: "Speaker: Anand Chitipothu\n\nDecorators are heavily used in modern python libraries and web frameworks. But they are still mystery to many people. In this talk I plan to discuss the concept of decorators in depth.\n\nhttps://pycon.sg/schedule/presentation/62/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/PyaX7gIlnkM/default.jpg", image2: "https://i.ytimg.com/vi/PyaX7gIlnkM/mqdefault.jpg", image3: "https://i.ytimg.com/vi/PyaX7gIlnkM/hqdefault.jpg", sort_order: nil},
  {video_id: "R_-rRei7W5A", title: "Expanding DevOps tools with MySQL Utilities - PyCon SG 2015", published_at: "2015-07-11 11:18:12", description: "Speaker: Ricky Setyawan\n\nMySQL utilities are a set of command-line utilities and a Python library for making the common tasks much easier and time-saving to accomplish. The library is written entirely in Python, meaning that it is not necessary to have any other tools or libraries installed to make it work. It is currently designed to work with Python v2.6 or later and there is no support (yet) for Python v3.1.\n\nhttps://pycon.sg/schedule/presentation/69/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/R_-rRei7W5A/default.jpg", image2: "https://i.ytimg.com/vi/R_-rRei7W5A/mqdefault.jpg", image3: "https://i.ytimg.com/vi/R_-rRei7W5A/hqdefault.jpg", sort_order: nil},
  {video_id: "y_jMqevmM8U", title: "Mid Life Bliss: Switching careers to software development - Ruby SG Meetup", published_at: "2015-06-02 15:09:27", description: "Speaker: Jason Z.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/y_jMqevmM8U/default.jpg", image2: "https://i.ytimg.com/vi/y_jMqevmM8U/mqdefault.jpg", image3: "https://i.ytimg.com/vi/y_jMqevmM8U/hqdefault.jpg", sort_order: 127},
  {video_id: "99Ts07ExH-c", title: "COPE CMS \"Create Once, Publish Everywhere\" - FOSSASIA 2015", published_at: "2015-03-17 06:10:14", description: "Speaker: Rasmus Skjoldan, TYPO3\n\nDescription:\n\"COPE\" means to Create Once, Publish Everywhere. The concept often accredited to the National Public Radio is having profound impact on organizations' ability to publish content in smarter ways. Yet, this publishing methodology has only reached few clients worldwide. Many still struggle the basic task of keeping content in sync across different channels and platforms. Behind the practical advantages of COPE lies a bigger story. Although the concept has been around since the dawn of digital content, the world is only just awakening to what it truly means. Completely decoupling content and presentation is still a fundamental paradigm shift that we have only seen the beginning of. Adding to the complexity of making COPE setups work well comes the human factor. Mentally grasping that a piece of content will go out to many and unknown output channels is hard for the typical, infrequent CMS editor. We have all yet to design great user interface patterns that help editors understand where content goes and realize what that means for the content production process. The UX Lead of the open source CMS project called Neos will provide insights into both the conceptual side to COPE—and talk about what's needed for CMS editors to work in a software environment where they don't know the exact output channels for their content.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/99Ts07ExH-c/default.jpg", image2: "https://i.ytimg.com/vi/99Ts07ExH-c/mqdefault.jpg", image3: "https://i.ytimg.com/vi/99Ts07ExH-c/hqdefault.jpg", sort_order: 213},
  {video_id: "h70PF1lTYgg", title: "Soft Digital Fabrication - FOSSASIA 2015", published_at: "2015-03-17 06:09:51", description: "Speaker: Mar Canet, Knitic\n\nDescription:\nThe talk is about the role of knitting in the field of digital fabrication and its' potential. Fab Labs and makerspaces are a lot about hard-surface object production. At the same time, the 1st digital fabrication tool, which is an electronic knitting machine back to 1976, has been forgotten and discontinued. Hence, the presentation will give an over view on knitting machines development, especially from the perspective of open hardware and makers' culture.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/h70PF1lTYgg/default.jpg", image2: "https://i.ytimg.com/vi/h70PF1lTYgg/mqdefault.jpg", image3: "https://i.ytimg.com/vi/h70PF1lTYgg/hqdefault.jpg", sort_order: 216},
  {video_id: "ny0KddtGbJM", title: "VLC Media Player: News and Future - FOSSASIA 2015", published_at: "2015-03-17 06:09:36", description: "Speaker: Rémi Denis-Courmont, VideoLAN \n\nDescription:\nVLC media player is one of the best known and most versatile opensource multimedia application. Originally a university project, the project transitioned to an open-source community. We will cover the recent and ongoing developments and tentative future work.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/ny0KddtGbJM/default.jpg", image2: "https://i.ytimg.com/vi/ny0KddtGbJM/mqdefault.jpg", image3: "https://i.ytimg.com/vi/ny0KddtGbJM/hqdefault.jpg", sort_order: 218},
  {video_id: "2yhVQBCc0yQ", title: "ExpEYES: Python Powered Open Source Pocket Science Lab - PyCon SG 2015", published_at: "2015-07-11 11:18:55", description: "Speaker: Praveen Patil\n\nExpEYES is an Open Source Pocket Science Lab for developing science experiments, classroom demonstrations and a test equipment for electronics hobbyists. ExpEYES combines the real-time measurement capability of micro-controllers with the ease and flexibility of Python programming language for data analysis and visualization. http://www.expeyes.in/\n\nhttps://pycon.sg/schedule/presentation/49/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/2yhVQBCc0yQ/default.jpg", image2: "https://i.ytimg.com/vi/2yhVQBCc0yQ/mqdefault.jpg", image3: "https://i.ytimg.com/vi/2yhVQBCc0yQ/hqdefault.jpg", sort_order: nil},
  {video_id: "wfqIobndC6I", title: "Easy contributable internationalization process with Sphinx - PyCon SG 2015", published_at: "2015-07-11 11:19:16", description: "Speaker: Takayuki Shimizukawa\n\nSphinx can extract paragraphs from sphinx document and store them into gettext format translation catalog files. Gettext format translation catalog is easy to translate from one language to other languages. Also Sphinx support internationalization by using such catalog files. You can use your favorite editors or services to translate your sphinx docs.\n\nhttps://pycon.sg/schedule/presentation/49/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/wfqIobndC6I/default.jpg", image2: "https://i.ytimg.com/vi/wfqIobndC6I/mqdefault.jpg", image3: "https://i.ytimg.com/vi/wfqIobndC6I/hqdefault.jpg", sort_order: nil},
  {video_id: "x69lQppEIE8", title: "Exciting days With Python - FOSSASIA 2015", published_at: "2015-03-17 06:09:27", description: "Speaker: Kushal Das, Python Software Foundation\n\nDescription: \nPython is a widely used general-purpose, high-level programming language. Its design philosophy emphasizes code readability, and its syntax allows programmers to express concepts in fewer lines of code than would be possible in languages such as C++ or Java. Python supports multiple programming paradigms, including object-oriented, imperative and functional programming or procedural styles. It features a dynamic type system and automatic memory management.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/x69lQppEIE8/default.jpg", image2: "https://i.ytimg.com/vi/x69lQppEIE8/mqdefault.jpg", image3: "https://i.ytimg.com/vi/x69lQppEIE8/hqdefault.jpg", sort_order: 219},
  {video_id: "RcN26hznmk4", title: "Improve your testing with Pytest and Mock - PyCon SG 2015", published_at: "2015-07-11 11:19:16", description: "Speaker: Gabe Hollombe\n\nTesting code with Pytest is an absolute pleasure. Less boilerplate makes your test more concise and its fixtures system helps you share setup code while still keeping your tests clear and understandable. I'll tell you all about how to get basic unit testing done, and I'll show you how to use Voidspace's Mock library to test collaborations between your objects, too.\n\nhttps://pycon.sg/schedule/presentation/50/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/RcN26hznmk4/default.jpg", image2: "https://i.ytimg.com/vi/RcN26hznmk4/mqdefault.jpg", image3: "https://i.ytimg.com/vi/RcN26hznmk4/hqdefault.jpg", sort_order: nil},
  {video_id: "rQpLtmxpRnk", title: "Day 1 Closing Keynote - PyCon SG 2015", published_at: "2015-07-11 11:21:52", description: "Speaker: Jessica McKellar\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/rQpLtmxpRnk/default.jpg", image2: "https://i.ytimg.com/vi/rQpLtmxpRnk/mqdefault.jpg", image3: "https://i.ytimg.com/vi/rQpLtmxpRnk/hqdefault.jpg", sort_order: nil},
  {video_id: "bFDNI4NjH8c", title: "Machine Learning: Going Deeper with Python and Theano - PyCon SG 2015", published_at: "2015-07-11 11:20:31", description: "Speaker: Martin Andrews\n\nMany recent advances in computer vision, speech recognition and Natural Language Processing (NLP) have come from Deep Learning research. One key enabler has been the use of GPUs to train bigger models on larger datasets. The Python module \"Theano\" can generate GPU code automatically - so that high level ideas can be implemented in high performance code seamlessly within the Python ecosystem.\n\nhttps://pycon.sg/schedule/presentation/65/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/bFDNI4NjH8c/default.jpg", image2: "https://i.ytimg.com/vi/bFDNI4NjH8c/mqdefault.jpg", image3: "https://i.ytimg.com/vi/bFDNI4NjH8c/hqdefault.jpg", sort_order: nil},
  {video_id: "sorvfsoIs8k", title: "Open Data Platform based on CKAN - FOSSASIA 2015", published_at: "2015-03-17 06:09:20", description: "Speaker: Emily Chen, GNOME\n\nDescription:\nI would like to talk about an open data solution built around CKAN, an\nopen source data portal, and an optimized OData plugin developed to\nspecific requirements for the Chinese market. This solution leverages important technology components from the China software development market with cloud platform to provide open source developers easy access and publishing tools with prevailing open data sources.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/sorvfsoIs8k/default.jpg", image2: "https://i.ytimg.com/vi/sorvfsoIs8k/mqdefault.jpg", image3: "https://i.ytimg.com/vi/sorvfsoIs8k/hqdefault.jpg", sort_order: 220},
  {video_id: "tmB0-DnXA_M", title: "Abusing Mobile Phones to Make the Internet of Things - FOSSASIA 2015", published_at: "2015-03-17 06:09:09", description: "Speaker: Jan Jongboom, Telenor Digital \n\nDescription:\nEveryone loves the Raspberry Pi or Arduino, they are amazing little\ndeveloper boards that drive almost all of the Internet of Things devices. Unfortunately they have one small problem... They're very, very expensive. Why do I need to shell out 30$ for a simple dev board, and 69$ for a GSM shield, when I can get a full smartphone for just 25$?! In this talk Jan Jongboom will literally break apart phones, introduce you to his alternative smartphone OS, hack volume buttons to control LEDs, solder some batteries and even juggle some devices.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/tmB0-DnXA_M/default.jpg", image2: "https://i.ytimg.com/vi/tmB0-DnXA_M/mqdefault.jpg", image3: "https://i.ytimg.com/vi/tmB0-DnXA_M/hqdefault.jpg", sort_order: 221},
  {video_id: "F4okAcmN0o4", title: "Network Security and Analysis with Python - PyCon SG 2015", published_at: "2015-07-11 11:20:31", description: "Speaker: Lee Yang Peng\n\nUsing Python, I have developed a program that attempts to be helpful in Deep Packet Inspection. Deep Packet Inspection is a process mainly used in network security to ensure integrity of network data sent across the network. Deep Packet Inspection is used to pre-empt and prevent malicious data from being transmitted over a network in order to ensure the security of the organization.\n\nhttps://pycon.sg/schedule/presentation/40/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/F4okAcmN0o4/default.jpg", image2: "https://i.ytimg.com/vi/F4okAcmN0o4/mqdefault.jpg", image3: "https://i.ytimg.com/vi/F4okAcmN0o4/hqdefault.jpg", sort_order: nil},
  {video_id: "QyZN1PYagQk", title: "Automating Jenkins CI server with python - PyCon SG 2015", published_at: "2015-07-11 11:20:31", description: "Speaker: Aleksey Maksimov\n\nThis talk will show a set of python libraries that will allow audience to learn how to automate Jenkins and create complex build pipelines.\n\nhttps://pycon.sg/schedule/presentation/61/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/QyZN1PYagQk/default.jpg", image2: "https://i.ytimg.com/vi/QyZN1PYagQk/mqdefault.jpg", image3: "https://i.ytimg.com/vi/QyZN1PYagQk/hqdefault.jpg", sort_order: nil},
  {video_id: "l6vhg9kQIcA", title: "Business logic with PostgreSQL and Python - PyCon SG 2015", published_at: "2015-07-12 07:28:31", description: "Speaker: Hubert Piotrowski\n\nWhen you can't use ORM and have to have a rock solid and consistent business logic in database why not using the power of Python as part of database?\n\nUsing functions and triggers and PostgreSQL magic with plpy.\n\nhttps://pycon.sg/schedule/presentation/60/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/l6vhg9kQIcA/default.jpg", image2: "https://i.ytimg.com/vi/l6vhg9kQIcA/mqdefault.jpg", image3: "https://i.ytimg.com/vi/l6vhg9kQIcA/hqdefault.jpg", sort_order: nil},
  {video_id: "XPc3XedFMeM", title: "Building a custom wrapper kernel for IPython - PyCon SG 2015", published_at: "2015-07-12 07:28:34", description: "Speaker: Hari Allamraju\n\nHave you ever used IPython and wondered how it worked? And if you can build your own kernel to use with the great IPython tools like notebook? This talk will walk you through how you can do that with an example kernel built by me.\n\nhttps://pycon.sg/schedule/presentation/44/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/XPc3XedFMeM/default.jpg", image2: "https://i.ytimg.com/vi/XPc3XedFMeM/mqdefault.jpg", image3: "https://i.ytimg.com/vi/XPc3XedFMeM/hqdefault.jpg", sort_order: nil},
  {video_id: "Y9-WEkw1Usw", title: "Debugging thousand CPU hour multigigabyte analyses with Python Decorators - PyCon SG 2015", published_at: "2015-07-11 11:21:22", description: "Speaker: Michal J. Gajda\n\nHow to handle multi-gigabyte datasets, multi-hour runs and debug them quickly using Python.\n\nhttps://pycon.sg/schedule/presentation/47/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/Y9-WEkw1Usw/default.jpg", image2: "https://i.ytimg.com/vi/Y9-WEkw1Usw/mqdefault.jpg", image3: "https://i.ytimg.com/vi/Y9-WEkw1Usw/hqdefault.jpg", sort_order: nil},
  {video_id: "cEqzg99nKTo", title: "Cutting Through The Container Hype - FOSSASIA 2015", published_at: "2015-03-17 06:08:36", description: "Speaker: Brian Proffitt, Red Hat\n\nDescription: \nVirtualization was the next Big Thing. Then cloud. Now, containers are at the peak of hype, led by the excitement surrounding Docker and containers. Project Atomic hopes to temper innovation with better\nmanagement and control, and it's not alone: CoreOS, Docker's suite of enterprise products, and most recently, Ubuntu's Ubuntu Core all hope to capture this market. But what is the market? Is container technology the best plan for DevOps and an increasingly cloud-oriented IT?\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/cEqzg99nKTo/default.jpg", image2: "https://i.ytimg.com/vi/cEqzg99nKTo/mqdefault.jpg", image3: "https://i.ytimg.com/vi/cEqzg99nKTo/hqdefault.jpg", sort_order: 224},
  {video_id: "tOMSS1tg0AQ", title: "Distributed Search and Open Index with Loklak - FOSSASIA 2015", published_at: "2015-03-17 06:08:29", description: "Speaker: Michael Christen, LokLak \n\nDescription:\nIs loklak a search portal? No, this is a backend search- and storageinfrastructure for microblog-messages. Make your own search portal! loklak scrapes tweets from twitter html pages (more message sources to come). We+You collect and share tweets with a peer-to-peer network.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/tOMSS1tg0AQ/default.jpg", image2: "https://i.ytimg.com/vi/tOMSS1tg0AQ/mqdefault.jpg", image3: "https://i.ytimg.com/vi/tOMSS1tg0AQ/hqdefault.jpg", sort_order: 225},
  {video_id: "vwK6bqURBJo", title: "Lightning Talks - Edu Summit 2015", published_at: "2015-07-11 10:22:59", description: "Produced by Engineers.SG", image1: "https://i.ytimg.com/vi/vwK6bqURBJo/default.jpg", image2: "https://i.ytimg.com/vi/vwK6bqURBJo/mqdefault.jpg", image3: "https://i.ytimg.com/vi/vwK6bqURBJo/hqdefault.jpg", sort_order: nil},
  {video_id: "wdCnc09MTEI", title: "How a lean and agile mindset can lead to more innovative products - FOSSAsia 2015", published_at: "2015-03-15 12:22:09", description: "Speaker: Chris Kruppa, evecoo\n\nDescription:\nMost innovative projects fail either because of wrong and not verified\nassumptions or because of fearing the risk to invest into insecure\nprojects. The lean and agile mindset deals with those fears and offer\ncertain practices to both develop an innovative product and to find\nfast the market fit. Therefore investments can be reduced and the\nchance for success increases by factors. In this workshop we will\nlearn some basics of the lean/agile mindset and apply some of the\npractices introduced by it's leaders. The workshop will be very\ninteractive: It is planned, that the participants will choose the practices\nthey want to learn during this workshop.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/wdCnc09MTEI/default.jpg", image2: "https://i.ytimg.com/vi/wdCnc09MTEI/mqdefault.jpg", image3: "https://i.ytimg.com/vi/wdCnc09MTEI/hqdefault.jpg", sort_order: 243},
  {video_id: "FjIuUvK6_zM", title: "Firefox OS - FOSSASIA 2015", published_at: "2015-03-17 06:08:22", description: "Topic: How Mozilla launches the Firefox OS open web mobile platform in Asia and how you can get involved\n\nSpeaker: Gen Kanai, Mozilla \n\nDescription:\nA presentation on Mozilla's 2014-15 Firefox OS launches in Asia with a focus on community marketing. Learn how Mozilla tackles the\nchallenges of launching an open web mobile device with our community and our partners. We welcome you to participate in our current and future launches in Asia and elsewhere.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/FjIuUvK6_zM/default.jpg", image2: "https://i.ytimg.com/vi/FjIuUvK6_zM/mqdefault.jpg", image3: "https://i.ytimg.com/vi/FjIuUvK6_zM/hqdefault.jpg", sort_order: 226},
  {video_id: "zEtiADQNfyk", title: "MariaDB - State of the Base - FOSSASIA 2015", published_at: "2015-03-17 06:08:13", description: "Speaker: Colin Charles, MariaDB\n\nDescription:\nMariaDB is a community-developed fork of the MySQL relational\ndatabase management system intended to remain free under the GNU GPL. Being a fork of a leading open source software system, it is notable for being led by the original developers of MySQL. The intent is also to maintain high compatibility with MySQL, ensuring a \"drop-in\" replacement capability with library binary equivalency and exact matching with MySQL APIs and commands.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/zEtiADQNfyk/default.jpg", image2: "https://i.ytimg.com/vi/zEtiADQNfyk/mqdefault.jpg", image3: "https://i.ytimg.com/vi/zEtiADQNfyk/hqdefault.jpg", sort_order: 227},
  {video_id: "lJN5bch7D_Y", title: "systemd: Where We Come from, and Where We Want to Go in 2015 - FOSSASIA 2015", published_at: "2015-03-17 06:07:54", description: "Speaker: Lennart Poettering, Red Hat \n\nDescription:\nsystemd is a core component of most major Linux distributions. The\nproject has been progressing fast in the past years, and there's a lot\nmore to come. In this talk I want to give an overview on the areas we\nworked on in the past year (kdbus, nspawn, ...) how they are\nprogressing and what's coming next. In this talk you'll hear first all the\nexciting stuff we have queued up for systemd!\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/lJN5bch7D_Y/default.jpg", image2: "https://i.ytimg.com/vi/lJN5bch7D_Y/mqdefault.jpg", image3: "https://i.ytimg.com/vi/lJN5bch7D_Y/hqdefault.jpg", sort_order: 229},
  {video_id: "OLs9zPP2phk", title: "Faster data processing in Python - PyCon SG 2015", published_at: "2015-07-12 07:28:14", description: "Speaker: Anand S\n\nThis talk will covers ways that help process and analyse visualise data faster in Python. The primary focus is on the technique (should you optimise? what to optimise? how to optimise?) while covering libraries that help with this (line_profiler, Pandas, Numba, etc.)\n\nhttps://pycon.sg/schedule/presentation/45/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/OLs9zPP2phk/default.jpg", image2: "https://i.ytimg.com/vi/OLs9zPP2phk/mqdefault.jpg", image3: "https://i.ytimg.com/vi/OLs9zPP2phk/hqdefault.jpg", sort_order: nil},
  {video_id: "8hSVCIL1YAE", title: "Writing interpreters for fun and profit - PyCon SG 2015", published_at: "2015-07-12 07:28:18", description: "Speaker: Terry Chia\n\nWriting a programming language interpreter is usually considered black magic. This talk aims to demystify the process by walking through the steps of building a simple interpreter from scratch using Python.\n\nhttps://pycon.sg/schedule/presentation/42/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/8hSVCIL1YAE/default.jpg", image2: "https://i.ytimg.com/vi/8hSVCIL1YAE/mqdefault.jpg", image3: "https://i.ytimg.com/vi/8hSVCIL1YAE/hqdefault.jpg", sort_order: nil},
  {video_id: "L6BJaRWQeT0", title: "Closing Keynote - PyCon SG 2015", published_at: "2015-07-12 07:46:19", description: "Speaker: Andrew Godwin\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/L6BJaRWQeT0/default.jpg", image2: "https://i.ytimg.com/vi/L6BJaRWQeT0/mqdefault.jpg", image3: "https://i.ytimg.com/vi/L6BJaRWQeT0/hqdefault.jpg", sort_order: nil},
  {video_id: "Ue2KCYA4wEg", title: "Computing Landscape in our Schools - Edu Summit 2015", published_at: "2015-07-11 10:22:59", description: "Speaker: Dr. Mooi Lee Choo, Senior Curriculum Specialist, MOE\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/Ue2KCYA4wEg/default.jpg", image2: "https://i.ytimg.com/vi/Ue2KCYA4wEg/mqdefault.jpg", image3: "https://i.ytimg.com/vi/Ue2KCYA4wEg/hqdefault.jpg", sort_order: nil},
