  {video_id: "4lmJJX2KoKY", title: "Cold War: City State - SingaporeJS", published_at: "2015-11-17 16:02:31", description: "Speaker: Simon Swain (@simon_swain)\n\nCold War is a exploration of simulation and graphics. We will dive in to smooth 60fps animation in the browser using html5 canvas, and see how much juice we can squeeze out of our systems. This session will also premiere the Cold War platform, giving you examples and tools for you to produce simulations based on the concepts in the talk. \n\nEvent Page: http://www.meetup.com/Singapore-JS/events/226393928/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/4lmJJX2KoKY/default.jpg", image2: "https://i.ytimg.com/vi/4lmJJX2KoKY/mqdefault.jpg", image3: "https://i.ytimg.com/vi/4lmJJX2KoKY/hqdefault.jpg", sort_order: nil},
  {video_id: "o2nxBjVpdVw", title: "Meteor Meetup with Arunoda Susiripala - Meteor Meetup April 2015", published_at: "2015-04-11 14:23:06", description: "Speaker: Arunoda Susiripala\n\nWe are group of people who think MeteorJS is awesome. We love it and embrace it very much. We are very fortunate to have Arunoda Surisipala from the Meteorhacks in town. Arunoda is a very prominent developer in the Meteor community and runs the Meteorhacks site as well as Kadira and numerous other projects. He is Singapore only for a few days but has kindly agreed to make time to meet our Meteor Singapore group.  \n\nMeteorhacks website: https://meteorhacks.com/\n\nKadira: https://kadira.io/ \n\nArunoda on Github: https://github.com/arunoda \n\nPS: Sorry for the clipped off audio mid way through.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/o2nxBjVpdVw/default.jpg", image2: "https://i.ytimg.com/vi/o2nxBjVpdVw/mqdefault.jpg", image3: "https://i.ytimg.com/vi/o2nxBjVpdVw/hqdefault.jpg", sort_order: 184},
  {video_id: "BcBWE5fDuvU", title: "Spring Boot 1.3 - Singapore Spring User Group", published_at: "2016-01-13 15:43:26", description: "Speaker: Sergi Almar, CTO, Voz.io (@sergialmar)\n\nSergi is a key person in the Spring ecosystem. He has been teaching Spring for over 5 years and is the organizer of the Spring.IO conference in Barcelona. He will be visiting Singapore next week to teach a class.  \nHe will be discussing the new features coming with Spring Boot 1.3 (Automatic Application restart, new auto-configurations...).\n\nEvent Page: http://www.meetup.com/singasug/events/227873656/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/BcBWE5fDuvU/default.jpg", image2: "https://i.ytimg.com/vi/BcBWE5fDuvU/mqdefault.jpg", image3: "https://i.ytimg.com/vi/BcBWE5fDuvU/hqdefault.jpg", sort_order: nil},
  {video_id: "YkV3KHAeonQ", title: "JVM and Tomcat optimisation - Singapore Spring User Group", published_at: "2016-01-13 15:43:22", description: "Speaker: Liu Dapeng, Java Tech Lead, PocketMath\n\nDapeng works on a high scale environment with millions of requests every minute. He has worked a lot on performance in the past years and will share some of the most interesting optimisations he has worked on this year.\n\nSlides: https://docs.google.com/presentation/d/1zUS7vMv4y3RmAy_1mq695zKk7zyPETpTSsippO3WwrQ/edit?usp=docslist_api\n\nEvent Page: http://www.meetup.com/singasug/events/227873656/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/YkV3KHAeonQ/default.jpg", image2: "https://i.ytimg.com/vi/YkV3KHAeonQ/mqdefault.jpg", image3: "https://i.ytimg.com/vi/YkV3KHAeonQ/hqdefault.jpg", sort_order: nil},
  {video_id: "fQWRoLf7bns", title: "The Seif Project by Douglas Crockford - talk.js", published_at: "2015-11-05 23:51:49", description: "Speaker: Douglas Crockford\n\nUpgrading the Web \n\nThe web was originally imagined to be a simple distributed document retrieval system. It is now being used for applications that go far beyond the system's original capabilities and intentions. We have found ways to make it work, but they are difficult and far too fragile. Many times companies have offered to replace the web with superior proprietary systems, but we rejected them. We have been adding features to the web, but this does little to correct the deep underlying deficiencies, increasing instead of reducing its complexity.\n\nThis talk suggests a way forward, taking inspiration from our successful transition from NTSC to HDTV. There is a way forward to a web that is safer, easier, and as good as we desire. \n\nDouglas Crockford is best known for his ongoing involvement in the development of the JavaScript language, for having popularized JSON, and for developing various JavaScript tools such as JSLint and JSMin. He is currently a senior JavaScript architect at PayPal, and is also a writer and speaker on JavaScript, JSON, and related web technologies. \n\nEvent Page: http://www.meetup.com/Singapore-JS/events/226070428/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/fQWRoLf7bns/default.jpg", image2: "https://i.ytimg.com/vi/fQWRoLf7bns/mqdefault.jpg", image3: "https://i.ytimg.com/vi/fQWRoLf7bns/hqdefault.jpg", sort_order: 0},
