  {video_id: "VPkh3qNRinQ", title: "Docker 101 - Docker Singapore / Singapore Cloud Foundry Meetup", published_at: "2015-09-09 17:28:47", description: "Speaker: Mario Loriedo\n\nThe first session we will introduce Docker. We will see what issues are addressed by containers and compare it to traditional VMs. Other topics that we will cover are:  \n* Running containers  \n* Creating containers images  \n* Dockerfiles  \n* Inter containers communication with volumes and links  \n* Publishing images and DockerHub\n\nSlides: https://speakerdeck.com/singasug/docker-101-mario-loriedo\n\nEvent Page:\nhttp://www.meetup.com/Docker-Singapore/events/225108841/\nhttp://www.meetup.com/Singapore-Cloud-Foundry-Meetup/events/225008895/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/VPkh3qNRinQ/default.jpg", image2: "https://i.ytimg.com/vi/VPkh3qNRinQ/mqdefault.jpg", image3: "https://i.ytimg.com/vi/VPkh3qNRinQ/hqdefault.jpg", sort_order: 18},
