  {video_id: "pOUi2UZlKYk", title: "Grace Huang - Fuckup Nights Singapore", published_at: "2015-08-12 16:13:45", description: "Grace Huang, Founder & Creative Director (in martial arts)\n\nGrace isn’t someone you will want to mess around with, and you’ll only need to see her business card to know why - She is one half of the dynamic duo behind Trifecta Martial Arts, and is trained in Brazilian Jiu-Jitsu (with medals under that, no less), Chinese Wushu and Muay Thai.\n\nBesides fighting, gruelling workouts, and the occasional extreme meal plans to keep in tip-top condition, this tough nut is pretty much a slave to her Macbook(s), whipping up creative design work as a freelance web/graphic designer and art director. Her work includes various projects for big-name brands and corporations including Ogilvy & Mather (Singapore), Mercedes Benz, and the Ritz Carlton Hotel (Singapore)… to name a few.\n\nIn other words, she’s also a nerd in disguise. Looks are always deceiving, aren’t they?\n\nEvent Page: https://www.eventbrite.com/e/fuckup-nights-singapore-vol-iv-tickets-17964491277\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/pOUi2UZlKYk/default.jpg", image2: "https://i.ytimg.com/vi/pOUi2UZlKYk/mqdefault.jpg", image3: "https://i.ytimg.com/vi/pOUi2UZlKYk/hqdefault.jpg", sort_order: 51},
  {video_id: "UGp1mxqDugw", title: "Architecting Australia's Government as a Service - Drupal Developers Network Singapore", published_at: "2015-06-18 10:11:53", description: "Speaker: Adam Malone, Solution Architect from Acquia.\nMeetup Date: 16 June 2015\n\nArchitecting Australia's Government as a Service:\nWith govCMS, the Government of Australia has made a best in breed Drupal platform available to all departments at a fraction of the cost it would take to do the same solo. By pioneering this solution, govCMS puts a stake in the ground and challenges other governments around the World to create a similar platform for their citizens.\n\nIn this session he was discussing:\n- The process to take govCMS from an idea to a platform\n- The govCMS distribution\n- Lessons learned along the way\n- Decisions taken to keep govCMS lean yet general\n- The benefits this project brings to governments worldwide\n- How you can contribute\n\nLink to the  presentation slides: https://www.dropbox.com/s/6u1gf87bel1vc9c/architecting%20govcms.pdf?dl=0\n\nLink: http://www.meetup.com/Drupal-SG/events/223035242/\n\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/UGp1mxqDugw/default.jpg", image2: "https://i.ytimg.com/vi/UGp1mxqDugw/mqdefault.jpg", image3: "https://i.ytimg.com/vi/UGp1mxqDugw/hqdefault.jpg", sort_order: 97},
