  {video_id: "LIvQrGHZiCQ", title: "Adrian Tan - Fuckup Nights - Singapore, Vol. II", published_at: "2015-05-20 19:04:00", description: "Speaker: Adrian Tan\n\nAdrian Tan is the co-founder and former Managing Director of RecruitPlus Consulting. He has spent a decade in recruitment was chairing the national recruitment association. Along the way, he co-authored a career guide book 'Everything You Wish to Ask a Headhunter'. He now does career training and career coaching under CareerLadder. He is married and have two sons and one daughter. More about him at www.adriantan.com.sg. \n\n--------------------------------\n\nFuckup Nights is a global movement to share business failure stories in a candid, irreverent way -- Fuckup Nights (FUN) was born in Mexico in 2012. It’s grown a hundred fold since.\n\nFuckup Nights is brought to you by:\n\nThe Hub Singapore (http://singapore.impacthub.net/) and \nCut The Small Talk (http://yes.cutthesmalltalk.com/)\n\n(Video produced by Engineers.SG)", image1: "https://i.ytimg.com/vi/LIvQrGHZiCQ/default.jpg", image2: "https://i.ytimg.com/vi/LIvQrGHZiCQ/mqdefault.jpg", image3: "https://i.ytimg.com/vi/LIvQrGHZiCQ/hqdefault.jpg", sort_order: 139},
  {video_id: "DrzefwYoUBk", title: "Building Android App at Carousell by Hoang N. - Singapore Android Developers May 2015 Meetup Part 1", published_at: "2015-05-17 15:40:14", description: "Building Android App at Carousell by Hoang N. - Singapore Android Developers May 2015 Meetup\n\nJoin the meetup group @\nhttp://www.meetup.com/Singapore-Android-Developers/\n\nCarousell is a free, simple and fuss-free way to buy and sell stuff straight from your mobile phone. With over 10 million listings worldwide, you can create beautiful listings in 30 seconds and shop a massive marketplace from wherever you are, whenever. In this talk, our lead Android engineer will be sharing his experience and tips in building the Carousell Android app from the ground up. He'll be highlighting some exciting current and upcoming things that we're doing in our Android app, including Material design, new Android patterns, etc.\n\nCheck out my favorite hotel booking website with massive amount of hotels around the world:\nhttp://bit.ly/tkn-booking\n\nThis video is taken with Sony RX100 III on Auto mode MP4 format without any post-processing.\n\nCheck out this awesome compact camera, Sony DSC-RX100M3 / RX100 Mark III in Amazon via below link:\nhttp://amzn.to/1ynwPtX", image1: "https://i.ytimg.com/vi/DrzefwYoUBk/default.jpg", image2: "https://i.ytimg.com/vi/DrzefwYoUBk/mqdefault.jpg", image3: "https://i.ytimg.com/vi/DrzefwYoUBk/hqdefault.jpg", sort_order: 147},
