  {video_id: "2XHPaU-8z0A", title: "Introduction to RxJava, with code examples by Xavier Lepretre - SG Android Developers 05/2015 Part 1", published_at: "2015-05-17 15:38:35", description: "Introduction to RxJava, with code examples by Xavier Lepretre - Singapore Android Developers May 2015 Meetup\n\nJoin the meetup group @\nhttp://www.meetup.com/Singapore-Android-Developers/\n\nFunctional Reactive Programming, and in particular its Java implementation, is well suited to applications that rely a lot on asynchronous calls and thread hopping. Discover the major coding elements of RxJava that will get you started. Non-developers may have their eyes glaze over by the 7th slide, though.\n\nSpeaker Bio: Xavier has been coding on and off from the days of BASIC and Pascal, has used RxJava with Android at TradeHero for the past 7 months and did not look back. \n\nCheck out my favorite hotel booking website with massive amount of hotels around the world:\nhttp://bit.ly/tkn-booking\n\nThis video is taken with Sony RX100 III on Auto mode MP4 format without any post-processing.\n\nCheck out this awesome compact camera, Sony DSC-RX100M3 / RX100 Mark III in Amazon via below link:\nhttp://amzn.to/1ynwPtX", image1: "https://i.ytimg.com/vi/2XHPaU-8z0A/default.jpg", image2: "https://i.ytimg.com/vi/2XHPaU-8z0A/mqdefault.jpg", image3: "https://i.ytimg.com/vi/2XHPaU-8z0A/hqdefault.jpg", sort_order: 149},
  {video_id: "1r_LVriK6uM", title: "Interfaces in Go - GoSG Meetup", published_at: "2015-05-13 03:04:29", description: "Speaker: Jonathan Gomez, Engineer @ Zumata\n\nThis talk will introduce interfaces and provide examples based on the Go standard library, various Github projects, Jonathan's work at Zumata and side projects - aiming to help you see use cases for interfaces in your Go code\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/1r_LVriK6uM/default.jpg", image2: "https://i.ytimg.com/vi/1r_LVriK6uM/mqdefault.jpg", image3: "https://i.ytimg.com/vi/1r_LVriK6uM/hqdefault.jpg", sort_order: 154},
  {video_id: "O0jdE7A-vbg", title: "Hackware v0.6", published_at: "2015-04-10 02:31:54", description: "Talks : \n\nHackRF and GNURadio - amateur radio platform up to 5.8GHz - Michał J. Gajda\n\nLightning Talks : \n- Tessel - Ben Looi\n- Jarvis, a smart medical tablet jar - Team Jarvis with Mohit Singh Kanwal\n- Raspberry Pi motion-activated light switch - Kai Hendry\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/O0jdE7A-vbg/default.jpg", image2: "https://i.ytimg.com/vi/O0jdE7A-vbg/mqdefault.jpg", image3: "https://i.ytimg.com/vi/O0jdE7A-vbg/hqdefault.jpg", sort_order: 186},
  {video_id: "Y1WtulpJEuI", title: "Collaborate with ease and Confidence - FOSSASIA 2015", published_at: "2015-03-17 06:10:06", description: "Speaker: Georg Greve, Kolab Systems AG\n\nDescription:\nCommunication and collaboration are the life blood of our professional world. Kolab is the comprehensive solution that enables collaboration across all platforms and with great ease. Based on a micro service architecture, it can integrate into environment or cloud strategy, and is the only solution of its kind that was built for highest levels of security from the ground up thanks to its origins with the German Federal Office for IT Security. It's use cases range from self-hosting on a Raspberry Pi to multiple data centres serving millions of users with advanced Audit, eDiscovery and Data Loss Prevention (DLP) scenarios. Kolab is also available as Kolab Now, a public service similar to Google Apps or Hotmail.com, but hosted in Switzerland under enhanced privacy provisions for professionals who cannot afford to compromise the data and communication of their customers and partners.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/Y1WtulpJEuI/default.jpg", image2: "https://i.ytimg.com/vi/Y1WtulpJEuI/mqdefault.jpg", image3: "https://i.ytimg.com/vi/Y1WtulpJEuI/hqdefault.jpg", sort_order: 214},
