  {video_id: "zsAch5aqXmc", title: "Building a reactive web frontend with Hoplon - Singapore Clojure Meetup", published_at: "2015-11-20 16:29:50", description: "Speaker: Melvin Zhang (@melvinzhangzy)\n\nMelvin is an avid programmer who enjoys designing and implementing novelalgorithms.  As the lead architect of Cosmiqo, Melvin is in charge of developing its sensor data aggregation and analytics platform. In his sparetime, Melvin works on the AI for Magarena, an open source card game project. He also gave the first talk in this meetup.\n\nEvent Page: http://www.meetup.com/Singapore-Clojure-Meetup/events/226645775/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/zsAch5aqXmc/default.jpg", image2: "https://i.ytimg.com/vi/zsAch5aqXmc/mqdefault.jpg", image3: "https://i.ytimg.com/vi/zsAch5aqXmc/hqdefault.jpg", sort_order: nil},
