  {video_id: "eIRorx4qAyg", title: "So What About Ruby on Rails    from a PHP Guy by Michael Cheng", published_at: "2014-10-30 15:39:27", description: "This talk was recorded at GeekCampSG 2014 on 18th October 2014.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/eIRorx4qAyg/default.jpg", image2: "https://i.ytimg.com/vi/eIRorx4qAyg/mqdefault.jpg", image3: "https://i.ytimg.com/vi/eIRorx4qAyg/hqdefault.jpg", sort_order: 299},
