  {video_id: "4_Y1jPGQkJQ", title: "Refactoring with Free Monad - Haskell SG", published_at: "2015-11-20 17:35:41", description: "Speaker: Paul Meng\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/4_Y1jPGQkJQ/default.jpg", image2: "https://i.ytimg.com/vi/4_Y1jPGQkJQ/mqdefault.jpg", image3: "https://i.ytimg.com/vi/4_Y1jPGQkJQ/hqdefault.jpg", sort_order: nil},
  {video_id: "vQQ4D9_6NK8", title: "Open Source Monitoring with Icinga - FOSSASIA 2015", published_at: "2015-03-17 06:08:53", description: "Speaker: Bernd Erk, Icinga\n\nDescription:\nMost sys admins have a love-hate relationship with Icinga/Nagios based monitoring solutions. Utilitarian and backed by a sizable community, users have learned to live with shortcomings in scaling, configuration and integration with tools common to modern architecture. After tiring of fiddly hacks and convoluted configs, the Icinga team decided to build a new, accessible and flexible core. Icinga 2 was born – infinitely and easily scalable, even as a cluster-ready solution, with load balancing, automated replication and business process monitoring out of the box. The talk will introduce Icinga 2’s innovative multi-threaded architecture and explain how it allows countless clusters of monitoring instances to run at speeds as yet unseen, all while minimizing maintenance. It will demonstrate how popular tools such as Graphite, Logstash and Puppet integrate better and easier than ever before. In addition to that the talk will introduce the new Icinga Web 2 interface and give a brief introduction into the technical architecture. A live demo will follow and well as a look into development plans to come.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/vQQ4D9_6NK8/default.jpg", image2: "https://i.ytimg.com/vi/vQQ4D9_6NK8/mqdefault.jpg", image3: "https://i.ytimg.com/vi/vQQ4D9_6NK8/hqdefault.jpg", sort_order: 223},
