  {video_id: "DTICUYrQF8o", title: "Hackatron Asia: Show & Tell by Ruby Group and Rails Girls", published_at: "2014-12-07 06:32:55", description: "Presented at Hackatron Asia 2014 (http://hackatron.techinasia.com)\n\nSpeaker: Anna Filippova, co-organizer of Ruby Group and Rails Girls\n\nRuby is a dynamic, reflective, object-oriented, general-purpose programming language. It was designed and developed in the mid-1990s. Ruby on Rails, or simply, Rails, is an open source web application framework written in Ruby.\nCome by and get “30 Random Ruby Tips” from Winston. Also hear from Anna Filippova, a co-organizer of Singapore Ruby User Group and a PhD candidate who does research on online communities. She’ll be speaking on “Build it and convince them to come: tips on seeding and growing your community. Lessons learnt from the Ruby community”.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/DTICUYrQF8o/default.jpg", image2: "https://i.ytimg.com/vi/DTICUYrQF8o/mqdefault.jpg", image3: "https://i.ytimg.com/vi/DTICUYrQF8o/hqdefault.jpg", sort_order: 272},
  {video_id: "Ky8k9enSYeQ", title: "Kevin Flanagan - Fuckup Nights - Singapore, Vol. II", published_at: "2015-05-20 19:04:00", description: "Speaker: Kevin Flanagan\n\nKevin Flanagan started as a bank teller at 17, but got bored and became a programmer, then a fixed income trader, then an MBA, then a Risk Manager (built a team & system that eventually exited for +S$100m), and finally Head of Global IT Development for an investment bank. He got bored again and left to join a startup which grew spectacularly, exited, and rolled up into another startup. That trainwrecked... so he joined another startup as chairman, raised 5m Euros VC, did a Masters in AI, tried to startup a supercomputer manufacturer but couldn't get traction, and started a Big Data consultancy but before the market was ready. He's now in Singapore and working on his sixth startup, in workflow. In summary, he's a hybrid problem solver with deep technical skills, good business acumen, and perhaps a penchant for seeing things a little too early and getting bored waiting.\n\n--------------------------------\n\nFuckup Nights is a global movement to share business failure stories in a candid, irreverent way -- Fuckup Nights (FUN) was born in Mexico in 2012. It’s grown a hundred fold since.\n\nFuckup Nights is brought to you by:\n\nThe Hub Singapore (http://singapore.impacthub.net/) and \nCut The Small Talk (http://yes.cutthesmalltalk.com/)\n\n(Video produced by Engineers.SG)", image1: "https://i.ytimg.com/vi/Ky8k9enSYeQ/default.jpg", image2: "https://i.ytimg.com/vi/Ky8k9enSYeQ/mqdefault.jpg", image3: "https://i.ytimg.com/vi/Ky8k9enSYeQ/hqdefault.jpg", sort_order: 137},
