  {video_id: "1xM_aoytgYo", title: "Q&A - Post screening of \"The Internet's Own Boy\"", published_at: "2014-07-06 08:38:27", description: "Held on 4 July 2014 at IDA Labs, National Design Centre Singapore\n\nThis video recording is produced by Engineers.sg", image1: "https://i.ytimg.com/vi/1xM_aoytgYo/default.jpg", image2: "https://i.ytimg.com/vi/1xM_aoytgYo/mqdefault.jpg", image3: "https://i.ytimg.com/vi/1xM_aoytgYo/hqdefault.jpg", sort_order: 322},
  {video_id: "E0CqGniuW2E", title: "Elisha Tan - Fuckup Nights - Singapore, Vol. II", published_at: "2015-05-20 19:04:00", description: "Speaker: Elisha Tan\n\nElisha Tan is the Ecosystem Builder at Tech in Asia. She builds tech startup ecosystems in Asia by providing the right resources and opportunities to founders, investors, accelerators/incubators and talent. Prior to working at TiA, Elisha founded Learnemy - an online marketplace for in-person classes, and she fucked that up after working on it for 3 years.\n\n--------------------------------\n\nFuckup Nights is a global movement to share business failure stories in a candid, irreverent way -- Fuckup Nights (FUN) was born in Mexico in 2012. It’s grown a hundred fold since.\n\nFuckup Nights is brought to you by:\n\nThe Hub Singapore (http://singapore.impacthub.net/) and \nCut The Small Talk (http://yes.cutthesmalltalk.com/)\n\n(Video produced by Engineers.SG)", image1: "https://i.ytimg.com/vi/E0CqGniuW2E/default.jpg", image2: "https://i.ytimg.com/vi/E0CqGniuW2E/mqdefault.jpg", image3: "https://i.ytimg.com/vi/E0CqGniuW2E/hqdefault.jpg", sort_order: 138},
