  {video_id: "T6-KRP1f504", title: "Introduction to RxJava, with code examples by Xavier Lepretre - SG Android Developers 05/2015 Part 3", published_at: "2015-05-17 15:37:57", description: "Introduction to RxJava, with code examples by Xavier Lepretre - Singapore Android Developers May 2015 Meetup\n\nJoin the meetup group @\nhttp://www.meetup.com/Singapore-Android-Developers/\n\nFunctional Reactive Programming, and in particular its Java implementation, is well suited to applications that rely a lot on asynchronous calls and thread hopping. Discover the major coding elements of RxJava that will get you started. Non-developers may have their eyes glaze over by the 7th slide, though.\n\nSpeaker Bio: Xavier has been coding on and off from the days of BASIC and Pascal, has used RxJava with Android at TradeHero for the past 7 months and did not look back. \n\nCheck out my favorite hotel booking website with massive amount of hotels around the world:\nhttp://bit.ly/tkn-booking\n\nThis video is taken with Sony RX100 III on Auto mode MP4 format without any post-processing.\n\nCheck out this awesome compact camera, Sony DSC-RX100M3 / RX100 Mark III in Amazon via below link:\nhttp://amzn.to/1ynwPtX", image1: "https://i.ytimg.com/vi/T6-KRP1f504/default.jpg", image2: "https://i.ytimg.com/vi/T6-KRP1f504/mqdefault.jpg", image3: "https://i.ytimg.com/vi/T6-KRP1f504/hqdefault.jpg", sort_order: 151},
