  {video_id: "TrsjljDjJHI", title: "Matt Mullenweg Live!", published_at: "2014-06-07 12:15:33", description: "Presented on Wednesday, 4 June 2014 in Singapore at the Microsoft Auditorium.\n\n============================================\n\nAbout Matt by Matt:\n\n\"I am a founding developer of WordPress, the Open Source software used by over 18% of the web, including this site. The website says WordPress is \"a state-of-the-art semantic personal publishing platform\" but more importantly WordPress is a part of who I am. Like eating, breathing, music, I can't not work on WordPress. The project touches a lot of people, something I've recently begun to appreciate. I consider myself very lucky to be able to work on something I love so much.\"\n\nWeb: http://ma.tt/\nTwitter: https://twitter.com/photomatt\n\n-----------------------------------------------------\n\nThis event was organized by the Singapore PHP User Group\n\nThe Singapore PHP User Group was founded on Dec 28, 2006. Our inaugural meetup was held on January 11, 2007 at Brewerkz. A grand total of 7 people RSVPed (about 5 showed up). The meetup really took off after we moved to Facebook in Nov 2007. Our first event on Facebook was filled to capacity at the SMU seminar room. We currently have 2000+ members on our Facebook Group (https://www.facebook.com/groups/sghypertextpreprocessors/).\nPHP (recursive acronym for \"PHP: Hypertext Preprocessor\") is a widely-used Open Source general-purpose scripting language that is especially suited for Web development and can be embedded into HTML.", image1: "https://i.ytimg.com/vi/TrsjljDjJHI/default.jpg", image2: "https://i.ytimg.com/vi/TrsjljDjJHI/mqdefault.jpg", image3: "https://i.ytimg.com/vi/TrsjljDjJHI/hqdefault.jpg", sort_order: 323},
