  {video_id: "RZcYL-IUpNs", title: "Novena and Open Hardware Development - FOSSASIA 2015", published_at: "2015-03-17 06:07:45", description: "Speaker: Bunnie Huang, Bunnie Studios \n\nDescription:\nBunnie will discuss underlying trends in technology that have conspired to enable small teams backed by user communities to create potentially disruptive open hardware ecosystems. Novena, an open hardware laptop that bunnie and his collaborator, Sean 'xobs' Cross, created will be presented as a case study of a project enabled by such trends.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/RZcYL-IUpNs/default.jpg", image2: "https://i.ytimg.com/vi/RZcYL-IUpNs/mqdefault.jpg", image3: "https://i.ytimg.com/vi/RZcYL-IUpNs/hqdefault.jpg", sort_order: 230},
