  {video_id: "fLzS53-234c", title: "Singapore as a Smart Nation - FOSSASIA 2015", published_at: "2015-03-17 06:09:01", description: "Speaker: Dr. Vivian Balakrishnan, Minister for Environment and Water Resources and Minister-incharge of Smart Nation, Singapore\n\nDescription:\nSingapore is building the World’s First Smart Nation, and the advent of the data tsunami will empower citizens, through access to data, to\nimprove lives, create economic opportunities, and help to strengthen\ncommunities.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/fLzS53-234c/default.jpg", image2: "https://i.ytimg.com/vi/fLzS53-234c/mqdefault.jpg", image3: "https://i.ytimg.com/vi/fLzS53-234c/hqdefault.jpg", sort_order: 222},
  {video_id: "lVhh-czieVc", title: "SSL and WordPress - WordPress Singapore", published_at: "2016-01-18 15:17:18", description: "Speaker: Robert Sim (@robertsky_)\n\nWhat is SSL and why is it important. Also will touch on deploying Let's Encrypt cert for dedicated/VPS hosted sites. \n\nEvent Page: http://www.meetup.com/WordPress-Singapore/events/227589326/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/lVhh-czieVc/default.jpg", image2: "https://i.ytimg.com/vi/lVhh-czieVc/mqdefault.jpg", image3: "https://i.ytimg.com/vi/lVhh-czieVc/hqdefault.jpg", sort_order: nil},
  {video_id: "qOAMM3RMzLQ", title: "The Power Of Free: How LiMux serves 15.000 - FOSSASIA 2015", published_at: "2015-03-17 06:08:02", description: "Speaker: Stefan Koehler, CronusConsult \n\nDescription:\nThe LiMux project has gained worldwide attention in 2003 when the City Of Munich decided to replace Windows with a linux--based client. Today more than 15.000 clients run LiMux. LiMux heavily relies on popular FOSS components like (K)Ubuntu, LibreOffice or Firefox but also adds some self-made magic ingredients. This talk will shed some light on the techniques used and how they work together.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/qOAMM3RMzLQ/default.jpg", image2: "https://i.ytimg.com/vi/qOAMM3RMzLQ/mqdefault.jpg", image3: "https://i.ytimg.com/vi/qOAMM3RMzLQ/hqdefault.jpg", sort_order: 228},
