  {video_id: "ZgxhS2PkrBM", title: "Document your code - FOSSAsia 2015", published_at: "2015-03-15 12:20:47", description: "Speaker: Kushal Das, Python Software Foundation\n\nDescription: \nIn the workshop the people will be introduced to reStructuredText & sphinx. Starting from quick-start of a project to document organization, code and topic cross-referencing, indexing. We will also go through running tests from your documentation, initial ideas on themes and deployment in readthedocs.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/ZgxhS2PkrBM/default.jpg", image2: "https://i.ytimg.com/vi/ZgxhS2PkrBM/mqdefault.jpg", image3: "https://i.ytimg.com/vi/ZgxhS2PkrBM/hqdefault.jpg", sort_order: 244},
  {video_id: "bSKBM6H1qIM", title: "How to Grow an Open Source Project: A Case Study of Python - FOSSAsia 2015", published_at: "2015-03-14 07:31:56", description: "Speaker: Stephen Turnbull, University of Tsukuba\n\nDescription:\nWhat makes a successful software development community? A good product based on good programming is important, of course. A common philosophy of quality in software helps keep the project on track. Also important is a community that welcomes \"new blood\", facilitates interaction, and fosters the development of its members. Based on interviews with leading developers and community leaders, we look at how these factors have influenced the growth of Python into one of the most popular programming languages.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/bSKBM6H1qIM/default.jpg", image2: "https://i.ytimg.com/vi/bSKBM6H1qIM/mqdefault.jpg", image3: "https://i.ytimg.com/vi/bSKBM6H1qIM/hqdefault.jpg", sort_order: 246},
  {video_id: "GNbXAetx-jc", title: "Smart Cities and image processing - FOSSAsia 2015", published_at: "2015-03-14 06:33:55", description: "Speaker: Aleksandro Montanha, Seebot\n\nDescription:\nWith the advent of mobile computing , popularized mainly by the increase in computing power and low cost devices, users using this technology passed more collaboratively to explore resources that were previously constrained to the personal computer. With this new behavior and mobility of possession , there was a significant increase in generation of media for later sharing on social networks. Currently the number of images captured and stored is huge, but there is currently no mechanisms and methodology for effective indexing for later intelligent search these files. The purpose of this presentation is to present is primarily the challenges and intelligent image processing in order to allow indexing of images for further analysis in the context of smart cities .\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/GNbXAetx-jc/default.jpg", image2: "https://i.ytimg.com/vi/GNbXAetx-jc/mqdefault.jpg", image3: "https://i.ytimg.com/vi/GNbXAetx-jc/hqdefault.jpg", sort_order: 249},
