  {video_id: "3a7wl_g0hOI", title: "Day 1 Ignites - DevOpsDays SG 2015", published_at: "2015-10-25 11:46:27", description: "Topics:\n\nSustainable Innovation - the Business Mantra for DevOps in Enterprise (Anoop Kumar Bhat) (http://www.devopsdays.org/events/2015-singapore/proposals/Sustainable%20Innovation%20the%20Business%20Mantra%20for%20DevOps%20in%20Enterprise/)\n\n\nThe Power of Personal Influence (Kimble Ngo) (http://www.devopsdays.org/events/2015-singapore/proposals/The%20Power%20of%20Personal%20Influence/)\n\nAgile: Break it down (Yue Lin Choong) (http://www.devopsdays.org/events/2015-singapore/proposals/Agile%20Break%20it%20down/)\n\n#noprojects (Evan Leybourn) (http://www.devopsdays.org/events/2015-singapore/proposals/noprojects/)\n\nCrawl before you Run, Implementing DevOps (Jason Man) (http://www.devopsdays.org/events/2015-singapore/proposals/Crawl%20before%20you%20Run,%20Implementing%20DevOps/)\n\nAutomated Docker Image Builds with Jenkins, Packer, and Kubernetes (Oyvind Roti) (http://www.devopsdays.org/events/2015-singapore/proposals/Automated%20Docker%20Image%20Builds%20with%20Jenkins,%20Packer,%20and%20Kubernetes/)\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/3a7wl_g0hOI/default.jpg", image2: "https://i.ytimg.com/vi/3a7wl_g0hOI/mqdefault.jpg", image3: "https://i.ytimg.com/vi/3a7wl_g0hOI/hqdefault.jpg", sort_order: nil},
