  {video_id: "alfpaDqeHB4", title: "3 Things You May Not Know About The Go Template Engine - GoSG", published_at: "2015-03-03 15:17:25", description: "Speaker: Chang Sau Sheong\n\nSlides: https://speakerdeck.com/sausheong/3-things-you-may-not-know-about-the-go-template-engine\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/alfpaDqeHB4/default.jpg", image2: "https://i.ytimg.com/vi/alfpaDqeHB4/mqdefault.jpg", image3: "https://i.ytimg.com/vi/alfpaDqeHB4/hqdefault.jpg", sort_order: 254},
