  {video_id: "Nm6kxpXRT0w", title: "Architecture Highlight: serv.sg - AWS User Group Singapore", published_at: "2016-01-06 17:32:54", description: "Speaker: Nicolas Mas, CTO, serv.sg (@nicolasmas)\n\nHow serv.sg deliver features using AWS infrastructure: programatically building and provisioning a stack before destroying it. This talk will explain what they do, why they do it and the tools they use (packer.io, terraform.io, ansible etc.). Includes a live demo of the whole cycle.\n\nPresentation Slides: http://www.slideshare.net/ConceptSL/building-software-by-feature-with-immutable-infrastructures-on-aws\n\nEvent Page: http://www.meetup.com/AWS-SG/events/226964694/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/Nm6kxpXRT0w/default.jpg", image2: "https://i.ytimg.com/vi/Nm6kxpXRT0w/mqdefault.jpg", image3: "https://i.ytimg.com/vi/Nm6kxpXRT0w/hqdefault.jpg", sort_order: nil},
