  {video_id: "Idzo_xzibV0", title: "The story behind Happyland 360 - Singapore Virtual Reality meetup", published_at: "2015-12-14 15:33:43", description: "Speaker: Vitaly Che\n\nHappyland360 is a collaboration between VOSTOKVR and V3RA Studios to show everyday life of people living in a slums of Manila. Using 360 video we want to show places that are not accessible by ordinary tourists and share stories that was never shared before.\n\nEvent Page: http://www.meetup.com/asiavrsg/events/227264257/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/Idzo_xzibV0/default.jpg", image2: "https://i.ytimg.com/vi/Idzo_xzibV0/mqdefault.jpg", image3: "https://i.ytimg.com/vi/Idzo_xzibV0/hqdefault.jpg", sort_order: nil},
  {video_id: "5fFp3ZGsUu4", title: "The Hitchhiker's Guide to 360 - Singapore Virtual Reality meetup", published_at: "2015-12-14 15:33:40", description: "Speaker: Tom Radford and Matt Edwards\n\nTom and Matt of local production house Click2View will explore from the creator's POV the intricacies, challenges and lessons learned with this fledgling technology -- everything from managing the software through and synching cameras to dealing with low light -- a learning curve they compare to the north face of the Eiger.\n\nDemo: https://www.youtube.com/watch?v=-MPQv7uyFvE\n\nEvent Page: http://www.meetup.com/asiavrsg/events/227264257/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/5fFp3ZGsUu4/default.jpg", image2: "https://i.ytimg.com/vi/5fFp3ZGsUu4/mqdefault.jpg", image3: "https://i.ytimg.com/vi/5fFp3ZGsUu4/hqdefault.jpg", sort_order: nil},
  {video_id: "lklUuCGKJKI", title: "Containers — What We Need to Know by Sriram Narayanan", published_at: "2015-10-03 14:55:19", description: "There is a lot of buzz around containers, with everyone associating themselves with these as a sure-shot approach to success! But what exactly are containers, and more importantly, what are they not!? After a mild amount of basics to get everyone on the same page, we engage in some myth-busting, diagnosis tracing, and some cautionary notes on what you still need to take care of.\n\nThis talk was recorded at GeekCampSG 2015 on 26 September 2015.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/lklUuCGKJKI/default.jpg", image2: "https://i.ytimg.com/vi/lklUuCGKJKI/mqdefault.jpg", image3: "https://i.ytimg.com/vi/lklUuCGKJKI/hqdefault.jpg", sort_order: nil},
