  {video_id: "gPrdFrivrLo", title: "Introduction to Laravel 4 - Meetup Oct 2013", published_at: "2013-10-31 03:19:20", description: "Speaker: Liang Anmian Benson\n\nhttp://laravel.com/\n\nSlides: http://www.slideshare.net/sgphpug/intro-to-laravel-4\n\nPresented at: Singapore PHP User Group Meetup Oct 2013 Meetup\n\nhttps://www.facebook.com/events/272874456170882/", image1: "https://i.ytimg.com/vi/gPrdFrivrLo/default.jpg", image2: "https://i.ytimg.com/vi/gPrdFrivrLo/mqdefault.jpg", image3: "https://i.ytimg.com/vi/gPrdFrivrLo/hqdefault.jpg", sort_order: 344},
  {video_id: "Nf8BQrIB4s0", title: "Secure E7y Nomadic Toolkit by Harish Pillay", published_at: "2015-10-03 14:55:27", description: "Access to the Internet is taken for granted. What happens when it fails catastophically? This talk will cover how you can set up your own network using everyday tech. First presented at FOSSAsia 2015.\n\nThis talk was recorded at GeekCampSG 2015 on 26 September 2015.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/Nf8BQrIB4s0/default.jpg", image2: "https://i.ytimg.com/vi/Nf8BQrIB4s0/mqdefault.jpg", image3: "https://i.ytimg.com/vi/Nf8BQrIB4s0/hqdefault.jpg", sort_order: nil},
  {video_id: "OJJlRWwk1MI", title: "Talk via Satellites, and Maybe the Moon by Roland Turner", published_at: "2015-10-03 16:46:51", description: "Why is ham radio still interesting now that the Internet is everywhere, and smartphones are in our pockets?\n\nI will talk about orbital prediction, free-hand antenna orientation, full-duplex radio operation, continual doppler-shift correction, an antenna the size of a tennis court, high-electron-mobility transistors, liquid nitrogen (won't have any at the talk...), digital signal processing and signal estimation and several related topics.\n\nIf I get adventurous, a live demonstration will be attempted.\n\nThis talk was recorded at GeekCampSG 2015 on 26 September 2015.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/OJJlRWwk1MI/default.jpg", image2: "https://i.ytimg.com/vi/OJJlRWwk1MI/mqdefault.jpg", image3: "https://i.ytimg.com/vi/OJJlRWwk1MI/hqdefault.jpg", sort_order: nil},
  {video_id: "vpWCh1cJzk8", title: "Lessons from Developing an AI to Play Magic: The Gathering by Melvin Zhang", published_at: "2015-10-03 16:46:54", description: "Although computers have beaten humans at Chess, Checkers, and even Jeopardy, games with complex board states (such as Go) or hidden information (such as Poker) have remained out of reach. Magic: the Gathering is a strategy card game that has both complex board states and hidden information.\n\nMagarena's goal is to develop an open source competitive computer MTG player. This talk distills some of the lessons learnt in developing an AI that is able to make decisions under uncertainly.\n\nThis talk was recorded at GeekCampSG 2015 on 26 September 2015.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/vpWCh1cJzk8/default.jpg", image2: "https://i.ytimg.com/vi/vpWCh1cJzk8/mqdefault.jpg", image3: "https://i.ytimg.com/vi/vpWCh1cJzk8/hqdefault.jpg", sort_order: nil},
  {video_id: "LCEmfsQm_RQ", title: "I'd TaaP that by Natalie Tay", published_at: "2015-10-03 16:46:58", description: "This talk is about using Telegram as a Platform. (Telegram is a cloud-based mobile and desktop messaging app with a focus on security and speed.)\n\nMy intent of this talk is to share the many ways we can make use of the Telegram Bot API to implement 'apps' that you can use with your favourite people, or even just for yourself.\n\nThe Telegram client can potentially save you a significant amount of development time, due to the simplicity of implementing your Bot and the already-ready simple-to-use UI.\n\nIf you still can't conceptualise this, think of this really simple problem which I have solved with TaaP: my favourite people can't decide where we should eat for our dinner meeting later.\n\nI will be demonstrating the entire process (if time permits :D) of solving my problem above, in Ruby.\n\nThis talk was recorded at GeekCampSG 2015 on 26 September 2015.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/LCEmfsQm_RQ/default.jpg", image2: "https://i.ytimg.com/vi/LCEmfsQm_RQ/mqdefault.jpg", image3: "https://i.ytimg.com/vi/LCEmfsQm_RQ/hqdefault.jpg", sort_order: nil},
