  {video_id: "PhYriLMnLHI", title: "How we do 60fps in our 3D RTS Mobile Game by @Dannie of Nonstop Games (now a King Studio)", published_at: "2014-10-08 09:18:01", description: "Find out what Nonstop Games is all about and how being part of King - Makers of Candy Crush, helps us push the limits of core gaming on mobile.\n\nTake a peek at our Fleet Tech Demo and engage in a Q&A session about 3D Rendering and RTS Gameplay Tech.\n\n* Render and animation of a large army Real-time \n* Hyper-real Ocean Simulation Particle Effects (including Projected Particles) \n* Real-time Physics Integration Pushing Mobile Memory and Computational Limits\n\nDannie Sim is senior engineer at King, the famous makers of Candy Crush, which needs no introduction.", image1: "https://i.ytimg.com/vi/PhYriLMnLHI/default.jpg", image2: "https://i.ytimg.com/vi/PhYriLMnLHI/mqdefault.jpg", image3: "https://i.ytimg.com/vi/PhYriLMnLHI/hqdefault.jpg", sort_order: 306},
