  {video_id: "l2iiUOYdEJ4", title: "Why the Mobile Web Is Slow and What You Can Do about It by Inian Parameshwaran", published_at: "2015-10-03 17:23:40", description: "Performance of your websites matters a great deal - especially on mobile. In this talk you will learn about what exactly slows down your website on mobile phones. JS, CSS, HTML, images, fonts - all play a very important role in how fast the browser is able to render your webpage.\n\nI will discuss how the interplay of these components affects web-page performance as a whole and how concepts like the critical rendering path can help you increase your website’s performance manifold. Using these techniques, we conducted an experiment on the top 100 Alexa websites. We were able to show a speed improvement of upto 300% on a standard 3G connection in some of these websites.\n\nThis talk was recorded at GeekCampSG 2015 on 26 September 2015.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/l2iiUOYdEJ4/default.jpg", image2: "https://i.ytimg.com/vi/l2iiUOYdEJ4/mqdefault.jpg", image3: "https://i.ytimg.com/vi/l2iiUOYdEJ4/hqdefault.jpg", sort_order: nil},
