  {video_id: "S5upIoJ4524", title: "Barcamp Singapore - YAHI Project", published_at: "2014-09-28 09:40:00", description: "A presentation by Roland Turner at Barcamp Singapore (September 2014). Roland has a very interesting project whereby he's built an internet-connected particle sensor to collect information on air pollution in Singapore. \n\nMore about the YAHI project here : http://rolandturner.com/yahi/", image1: "https://i.ytimg.com/vi/S5upIoJ4524/default.jpg", image2: "https://i.ytimg.com/vi/S5upIoJ4524/mqdefault.jpg", image3: "https://i.ytimg.com/vi/S5upIoJ4524/hqdefault.jpg", sort_order: 313},
  {video_id: "uJsy7rn_RGc", title: "WebAudio: an Emerging Platform for Modern Audio Applications by Chinmay Pendharkar", published_at: "2015-10-04 00:39:27", description: "The Web Audio standard is enabling the creation of fully functional Audio application made with open Web technologies. This talk will go through the basics of the functionality that Web Audio enables, and highlight some open source libraries, frameworks and projects built on top of Web Audio.\n\nThis talk was recorded at GeekCampSG 2015 on 26 September 2015.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/uJsy7rn_RGc/default.jpg", image2: "https://i.ytimg.com/vi/uJsy7rn_RGc/mqdefault.jpg", image3: "https://i.ytimg.com/vi/uJsy7rn_RGc/hqdefault.jpg", sort_order: nil},
  {video_id: "3j7tcL-Rad4", title: "Developer Happiness with Terminal Shortcuts by Bryan Lim", published_at: "2015-10-03 17:23:43", description: "This talk is about a rubygem called aka - a shortcut to manage terminal shortcut for the productivity and happiness of developers.\n\naka improves your workflow and give you more time to focus on the things that matter.\n\naka started as a weekend project and became open source in 2015. aka was created while on a travel trip to Ho Chi Minh and Penang.\n\nThis talk was recorded at GeekCampSG 2015 on 26 September 2015.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/3j7tcL-Rad4/default.jpg", image2: "https://i.ytimg.com/vi/3j7tcL-Rad4/mqdefault.jpg", image3: "https://i.ytimg.com/vi/3j7tcL-Rad4/hqdefault.jpg", sort_order: nil},
