  {video_id: "Hm7bkFiq4MY", title: "From Tupperware to Autonomous Underwater Vehicle by Goh Eng Wei", published_at: "2015-10-04 01:04:16", description: "Autonomous Vehicles are systems of the future enabled by increasing computational power, advancing electronics and artificial intelligence. The distance between man and machine has never been closer.\n\nEnter the Autonomous Underwater Vehicle (AUV). AUVs explore a domain close to our hearts but as dangerous and difficult as space: the infinite ocean. The applications for these systems range from ocean survey to mine counter-measure to wreckage search and rescue.\n\nMy talk will share on the exciting journey I embarked on in AUV design and development from tupperware AUVs to the State-of-the-art AUVs. These AUVs have been deployed to compete against the best minds from around the world in completing a series of challenges much resembling some of the real world problems we face today.\n\nThis talk was recorded at GeekCampSG 2015 on 26 September 2015.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/Hm7bkFiq4MY/default.jpg", image2: "https://i.ytimg.com/vi/Hm7bkFiq4MY/mqdefault.jpg", image3: "https://i.ytimg.com/vi/Hm7bkFiq4MY/hqdefault.jpg", sort_order: nil},
