  {video_id: "wNy5N9wjyWg", title: "Continuous Integration with Phing & Hudson - Meetup Oct 2013", published_at: "2013-10-31 03:19:20", description: "Speaker: Shreeniwas Iyer, Vocanic Singapore\n\n\"If you are into PHP development and are looking into Continuous Integration options, then come and join this meetup. I am going to be speaking about CI in the PHP world using Git+Phing+Hudson.\"\n\nSlides: http://www.slideshare.net/shreeniwasiyer/2013-1028-php-ug-presentation-ci-using-phing-and-hudson\n\nPresented at: Singapore PHP User Group Meetup Oct 2013 Meetup\n\nhttps://www.facebook.com/events/272874456170882/", image1: "https://i.ytimg.com/vi/wNy5N9wjyWg/default.jpg", image2: "https://i.ytimg.com/vi/wNy5N9wjyWg/mqdefault.jpg", image3: "https://i.ytimg.com/vi/wNy5N9wjyWg/hqdefault.jpg", sort_order: 345},
