  {video_id: "1JwxU3Mlc-c", title: "Build Your First Computer with FPGA by Michał J. Gajda", published_at: "2015-10-04 01:04:20", description: "Open source allowed us to get familiar with inner working of big software projects, and open hardware efforts do the same to hardware systems.\n\nWe may use Field Programmable Gate Array technology to program our own microprocessors architectures, and computer systems.\n\nSo why not to do it during GeekCamp?\n\nI show you how to design a simple microprocessor system with its own memory, serial console interface, and a video controller.\n\nThis talk was recorded at GeekCampSG 2015 on 26 September 2015.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/1JwxU3Mlc-c/default.jpg", image2: "https://i.ytimg.com/vi/1JwxU3Mlc-c/mqdefault.jpg", image3: "https://i.ytimg.com/vi/1JwxU3Mlc-c/hqdefault.jpg", sort_order: nil},
  {video_id: "fXs99u6AcWc", title: "Build WiFi Gadgets using ESP8266 by Baoshi", published_at: "2015-10-04 01:04:23", description: "ESP8266 is the new internet's favorite WiFi micro-controller. I will share current development landscape of this platform, do's and don't's on project design, as well as some success/failure projects.\n\nI will also demonstrate the MQTT Clock I built for Makefaire SG, detailing its software architecture and the convenience of having a RTOS inside ESP8266.\n\nThis talk was recorded at GeekCampSG 2015 on 26 September 2015.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/fXs99u6AcWc/default.jpg", image2: "https://i.ytimg.com/vi/fXs99u6AcWc/mqdefault.jpg", image3: "https://i.ytimg.com/vi/fXs99u6AcWc/hqdefault.jpg", sort_order: nil},
  {video_id: "balk-3BF4ro", title: "Singapore Ruby Meetup (Nov 2013)", published_at: "2013-11-22 06:29:06", description: "Singapore Ruby Group Meetup on 19 Nov 2013 at Silicon Straits\n\nhttp://www.meetup.com/Singapore-Ruby-Group/events/150110982/\n\n1. Install Native Dependencies Using Natives Gem \n- Teo Hui Ming, @teohm, Favorite Medium\n(Slides: https://speakerdeck.com/teohm/rubysg-meetup-gem-install-natives)\n\n2. Hello Elixir! \n- Benjamin Tan, @bentanweihao\n(Slides: https://speakerdeck.com/benjamintan/hello-elixir)\n\n3. 5 Random Ruby Tips \n- Dr. Khoo Chong-Yee, @CantabIP\n(Slides: https://speakerdeck.com/cantabip/5-random-ruby-tips)\n\nVideo Produced by Engineers.SG", image1: "https://i.ytimg.com/vi/balk-3BF4ro/default.jpg", image2: "https://i.ytimg.com/vi/balk-3BF4ro/mqdefault.jpg", image3: "https://i.ytimg.com/vi/balk-3BF4ro/hqdefault.jpg", sort_order: 340},
  {video_id: "5C6JOhJcK3Q", title: "SingaporeJS talk.js on 11 Nov 2013", published_at: "2013-11-13 00:44:25", description: "http://www.meetup.com/Singapore-JS/events/149046752/\n\nOn 11 Nov 2013\nMicrosoft Singapore, Level 22, Room CF12\n\nTalks:\n\n* Google coder on RaspberryPI: Teaching JS to newbie -- Sayanee Basu \n* Ghost: nodejs blogging platform -- Steve Teo \n* Multiple Dispatch, explained in JavaScript -- Axel Rauschmayer\n* RequireJS and AMD -- Kengo Toda \n* Shadow DOM: what is it and why? -- Tim Oxley \n\n(Video recorded by Engineers.sg)", image1: "https://i.ytimg.com/vi/5C6JOhJcK3Q/default.jpg", image2: "https://i.ytimg.com/vi/5C6JOhJcK3Q/mqdefault.jpg", image3: "https://i.ytimg.com/vi/5C6JOhJcK3Q/hqdefault.jpg", sort_order: 341},
  {video_id: "qmuURZ1wJHo", title: "SGGeekGirls Meetup 7 Nov 2013", published_at: "2013-11-12 10:59:12", description: "http://www.sggeekgirls.com/sg-geek-girls-meetup-user-research-the-ux-edition-part-ii/\n\nSG Geek Girls Meetup -- Anatomy of a UX Practitioner (the user research edition)\n7 Nov 2013\n\nWhy are user experience practitioners able to translate user problems to usable design? Do they have bionic sensing abilities? What is the magical blend of traits and temperaments that makes a great UX-er?\nSamantha Yuen interviewed 20 UX practitioners, researchers and ethnographers worldwide and uncovers some surprises that may cause you to re-evaluate your assumptions about the profession. She will also share her process for this study -- from designing questions to identifying insights.\nExpect an interactive session -- boys welcome too! (Bring a girl along!)\n\n(Video produced by Engineers.sg)", image1: "https://i.ytimg.com/vi/qmuURZ1wJHo/default.jpg", image2: "https://i.ytimg.com/vi/qmuURZ1wJHo/mqdefault.jpg", image3: "https://i.ytimg.com/vi/qmuURZ1wJHo/hqdefault.jpg", sort_order: 342},
  {video_id: "1dMg_nLNnqc", title: "Hackatron Asia: Tips & Tricks in securing your WordPress installation", published_at: "2014-12-07 06:34:46", description: "Presented at Hackatron Asia 2014 (http://hackatron.techinasia.com)\n\nSpeaker: Lester Chan. Lester’s WordPress plugins have had 11 million downloads and is being used by several Fortune 500 companies.\n\nWordPress powers 22% of the web and many popular sites are on WordPress. Because of it’s popularity, lots of attacks are being targeted at WordPress sites. In my presentation, I will give some tips and tricks on how to secure your WordPress website.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/1dMg_nLNnqc/default.jpg", image2: "https://i.ytimg.com/vi/1dMg_nLNnqc/mqdefault.jpg", image3: "https://i.ytimg.com/vi/1dMg_nLNnqc/hqdefault.jpg", sort_order: 273},
