  {video_id: "nT4f6dYx4bg", title: "Improving CloudFront for Better Video Delivery - AWS User Group Singapore", published_at: "2016-01-06 17:32:43", description: "Speaker: Daniel Muller, System Administrator, Spuul (@danielmullerch)\n\nCloudfront's pitfalls and missing features: building tools around Cloudfront to boost content delivery\n\nEvent Page: http://www.meetup.com/AWS-SG/events/226964694/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/nT4f6dYx4bg/default.jpg", image2: "https://i.ytimg.com/vi/nT4f6dYx4bg/mqdefault.jpg", image3: "https://i.ytimg.com/vi/nT4f6dYx4bg/hqdefault.jpg", sort_order: nil},
  {video_id: "4UXLlA4lP04", title: "Signaling Out of Callback Hell by Omer Iqbal", published_at: "2015-10-04 02:45:38", description: "Async processes are hard to reason about. Especially when you're debugging them under four layers of nested callbacks. From handling complex UI interactions to coordinating parallel tasks, programming in an async world can be frustrating, especially if you're using an imperative programming languange/framework with mutable state.\n\nThis talk will examine how Functional Reactive Programming (FRP) provides a solution to these problems. By modelling async flows as streams of values, and performing transformations on those streams, FRP enables such processes to be written in a safer, declarative manner. This talk would use ReactiveCocoa and how it aids development on iOS and Mac as a case study.\n\nSlides: http://www.slideshare.net/olenhad/signal-ing-out-of-callback-hell\n\nThis talk was recorded at GeekCampSG 2015 on 26 September 2015.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/4UXLlA4lP04/default.jpg", image2: "https://i.ytimg.com/vi/4UXLlA4lP04/mqdefault.jpg", image3: "https://i.ytimg.com/vi/4UXLlA4lP04/hqdefault.jpg", sort_order: nil},
