  {video_id: "OHKYeD9JYzc", title: "Wifi Controlled Xmas Lights on ESP8266 - Hackware", published_at: "2015-12-31 17:18:23", description: "Speaker: Alex Filimonov \n\nSlides & schematic: https://docs.google.com/presentation/d/1EWOw6fFYqhBJlpkgLnPzTG-7rT0xeMKkZ-UXcBIhPjs/mobilepresent?pli=1\n\nEvent Page: https://www.facebook.com/events/166887240335382/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/OHKYeD9JYzc/default.jpg", image2: "https://i.ytimg.com/vi/OHKYeD9JYzc/mqdefault.jpg", image3: "https://i.ytimg.com/vi/OHKYeD9JYzc/hqdefault.jpg", sort_order: nil},
  {video_id: "87smRPkBN8g", title: "Protoype for Production - FOSSAsia 2015", published_at: "2015-03-14 06:33:08", description: "Topic: Protoype for Production. Get ready to launch in a week with Django+Ansible and friends!\n\nSpeaker: Dhruvkumar Gohil, IshiSystems\n\nDescription:\nSharing our whole Idea to Execution to Production work flow and tooling (all open source) centred around awesome Django. Ansible + AngujarJS + Postgresql Full Text Search + Supervisord + Nginx+Uwsgi. Also includes best practices used with Trello + Git and lot of common sense!\n\nThe talk is intended to be a crisp introduction to using python to develop all sorts of embedded applications. The knowledge gained will help developers get started developing wearable, robotic, Realtime, IoT applications among others. I hope the audience will find the ideas and work of a fresh young innovator to their liking.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/87smRPkBN8g/default.jpg", image2: "https://i.ytimg.com/vi/87smRPkBN8g/mqdefault.jpg", image3: "https://i.ytimg.com/vi/87smRPkBN8g/hqdefault.jpg", sort_order: 251},
