  {video_id: "lx6L51BpGio", title: "Supervising Services from Scripts - AWS User Group Singapore", published_at: "2016-01-06 23:36:26", description: "Speaker: Chris Forno (@jekor)\n\nDid you know that you can use the AWS API via JavaScript in a web application? Why would you want to do so? We'll work through a couple examples of applications you can build that interact with AWS from the browser and explain how they can be useful. We'll also see how to build these apps securely (without exposing your credentials).\n\nEvent Page: http://www.meetup.com/AWS-SG/events/226964694/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/lx6L51BpGio/default.jpg", image2: "https://i.ytimg.com/vi/lx6L51BpGio/mqdefault.jpg", image3: "https://i.ytimg.com/vi/lx6L51BpGio/hqdefault.jpg", sort_order: nil},
