  {video_id: "z4s_UxLyA-c", title: "CSS Shapes - Singapore CSS", published_at: "2015-11-22 14:40:54", description: "Speaker: Chen Hui Jing (@hj_chen)\n\nHui Jing played basketball for Malaysia for 6 years and before realising that CSS was better than all that physical activity. She is a senior developer at Publicis Singapore.\n\nEvent Page: http://www.meetup.com/Singapore-CSS/events/226313643/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/z4s_UxLyA-c/default.jpg", image2: "https://i.ytimg.com/vi/z4s_UxLyA-c/mqdefault.jpg", image3: "https://i.ytimg.com/vi/z4s_UxLyA-c/hqdefault.jpg", sort_order: nil},
