  {video_id: "k5qzFYWzLUc", title: "Hackatron Asia: Bitcoin: Why And How You Can Use It In Your Own Project", published_at: "2014-12-07 06:32:28", description: "Presented at Hackatron Asia 2014 (http://hackatron.techinasia.com)\n\nSpeaker: Tomas Forgac, Coin of Sale\n\nLearn about the societal and economical implications of Bitcoin, Bitcoin nodes, how to set them up, and the speeding up of blockchain download. Learn about the types of deterministic wallets, and how to use them in your projects; learn about sidechains, appcoins and how to promote your project in the Bitcoin space.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/k5qzFYWzLUc/default.jpg", image2: "https://i.ytimg.com/vi/k5qzFYWzLUc/mqdefault.jpg", image3: "https://i.ytimg.com/vi/k5qzFYWzLUc/hqdefault.jpg", sort_order: 270},
  {video_id: "6MDc3_8TsUA", title: "Game of Drones: Algorithms and Hardware Design for Quadcopters by Shipeng Xu", published_at: "2014-10-30 15:39:27", description: "This talk was recorded at GeekCampSG 2014 on 18th October 2014.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/6MDc3_8TsUA/default.jpg", image2: "https://i.ytimg.com/vi/6MDc3_8TsUA/mqdefault.jpg", image3: "https://i.ytimg.com/vi/6MDc3_8TsUA/hqdefault.jpg", sort_order: 287},
  {video_id: "jjj1ToKRHqQ", title: "AB Testing Framework in Go for More Than Just Color Copy Changes by Ishan Agrawal", published_at: "2014-10-30 15:39:27", description: "This talk was recorded at GeekCampSG 2014 on 18th October 2014.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/jjj1ToKRHqQ/default.jpg", image2: "https://i.ytimg.com/vi/jjj1ToKRHqQ/mqdefault.jpg", image3: "https://i.ytimg.com/vi/jjj1ToKRHqQ/hqdefault.jpg", sort_order: 301},
  {video_id: "RETxgJcXBAY", title: "Equity Option Implied Volatility Analytics with Python - PyData Singapore", published_at: "2016-01-20 02:23:04", description: "Speaker: Jason Strimpel (@JasonStrimpel)\n\nPython has become an increasingly important tool in the domain of quantitative and algorithmic trading and research. This extends from senior quantitative analysts pricing complex derivatives using numerical techniques all the way to the retail trader using closed form valuation methods and analysis techniques. This talk will focus on the uses of Python in discovering unobserved features of listed equity options.\n\nThe Black-Scholes option pricing formula was first published in 1973 in a paper called \"The Pricing of Options and Corporate Liabilities\". In that paper Fischer Black and Myron Scholes derived an equation which estimates the price of an option over time. This formula and its associated \"greeks\" have become ubiquitous in options trading.\n\nIn this talk, we'll demonstrate how to gather options data using the Pandas module and apply various transformations to obtain the theoretical value of the option and the associated greeks. We'll then extend the talk to discuss implied volatility and show how to use Numpy methods to compute implied volatility. We'll use the results to visualize the so-called volatility skew and term structure to help inform potential trading decisions.\n\nEvent Page: http://www.meetup.com/PyData-SG/events/226837711/\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/RETxgJcXBAY/default.jpg", image2: "https://i.ytimg.com/vi/RETxgJcXBAY/mqdefault.jpg", image3: "https://i.ytimg.com/vi/RETxgJcXBAY/hqdefault.jpg", sort_order: nil},
  {video_id: "c_BFKZynT-Y", title: "Linda Liukas - Rails Girls Singapore (RDRC Edition) 2015", published_at: "2015-06-06 16:18:09", description: "Speaker: Linda Liukas\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/c_BFKZynT-Y/default.jpg", image2: "https://i.ytimg.com/vi/c_BFKZynT-Y/mqdefault.jpg", image3: "https://i.ytimg.com/vi/c_BFKZynT-Y/hqdefault.jpg", sort_order: 118},
  {video_id: "hPbescyWWYg", title: "Q & A with Vaidehi - Rails Girls Singapore (RDRC Edition) 2015", published_at: "2015-06-06 16:35:10", description: "Speaker: Vaidehi Joshi\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/hPbescyWWYg/default.jpg", image2: "https://i.ytimg.com/vi/hPbescyWWYg/mqdefault.jpg", image3: "https://i.ytimg.com/vi/hPbescyWWYg/hqdefault.jpg", sort_order: 123},
  {video_id: "yxRFEVoXqOs", title: "MySQL Performance Schema - FOSSAsia 2015", published_at: "2015-03-15 12:24:14", description: "Topic: MySQL Performance Schema - Monitoring MySQL Server with Perfromance Schema and enhancement in MySQL 5.7\n\nSpeaker: Mayank Prasad, Oracle India Private Limited\n\nDescription:\nThe MySQL Performance Schema is a feature for monitoring Oracle's\nMySQL Server execution at a low level. This versatile and tightly\nintegrated component collects performance and session data from\nvarious subsystems within the server during runtime with minimal\nimpact on overall server performance. This feature was introduced in\nMySQL 5.5 and MySQL 5.6 was released with great enhancements in\nit for performance monitoring and tuning. In 5.7 milestone releases as\nwell, there are multiple new functionalities have been added. This talk\naims to give an overview of Performance Schema and how/what\nstatistical information user is provided with using Performance\nSchema and how that information can be used for monitoring and\ntrouble shooting to track an issue back to the relevant file and line of\ncode in source file.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/yxRFEVoXqOs/default.jpg", image2: "https://i.ytimg.com/vi/yxRFEVoXqOs/mqdefault.jpg", image3: "https://i.ytimg.com/vi/yxRFEVoXqOs/hqdefault.jpg", sort_order: 236},
  {video_id: "IxFyWWAk2Vs", title: "Testing - Best Practices in Open Source World - FOSSAsia 2015", published_at: "2015-03-15 12:24:27", description: "Speaker: Amita Sharma, Red Hat\n\nDescription:\n1. How to contribute in improving quality of open source software\n2. How to create test harness for open source software.\n3. How to alter your software development model to produce bug-free\ncode.\n4. Altering your development model to match SW quality standards.\n5. Study the technology, know the feature well and use your\nexperience\n6. Know the point when it is time to report a bug\n7. How to troubleshoot that buggy situation.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/IxFyWWAk2Vs/default.jpg", image2: "https://i.ytimg.com/vi/IxFyWWAk2Vs/mqdefault.jpg", image3: "https://i.ytimg.com/vi/IxFyWWAk2Vs/hqdefault.jpg", sort_order: 235},
  {video_id: "-JflSVegceE", title: "Configuration Management Systems on the Desktop - FOSSAsia 2015", published_at: "2015-03-15 12:24:40", description: "Speaker: Lyle Kozloff, Asian Hope \n\nDescription:\nTools like Puppet, Ansible and Chef are well known for their power in\nmanaging thousands of servers. They're not as well known for\nmanaging workstations. The unique nature of workstations makes this\nuse case challenging in occasionally surprising ways. Lyle Kozloff has\nbeen managing hundreds of desktops and laptops in an education\nenvironment using Puppet Open Source for the past two years and\nwill share some insights, provide some tips and show some code that\nwill help anyone wanting to leverage a configuration management\nsystem in their own environment.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/-JflSVegceE/default.jpg", image2: "https://i.ytimg.com/vi/-JflSVegceE/mqdefault.jpg", image3: "https://i.ytimg.com/vi/-JflSVegceE/hqdefault.jpg", sort_order: 234},
  {video_id: "sFTgVVCPxnU", title: "All about web application testing - FOSSAsia 2015", published_at: "2015-03-15 12:24:51", description: "Speaker: Anisha Narang, Red Hat \n\nDescription:\nWeb application testing is all about validating the user flow and\nchecking the functionality available to the end user. We would explore\nsome tools we can use to test the front end of a web application. Talk\na little about tools like Selenium, Wait and see if we can use these\nalong with the programming language of our choice. Also, I would be\nconsidering some of the common issues faced while front end testing\ncomes to picture and discuss some best practices.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/sFTgVVCPxnU/default.jpg", image2: "https://i.ytimg.com/vi/sFTgVVCPxnU/mqdefault.jpg", image3: "https://i.ytimg.com/vi/sFTgVVCPxnU/hqdefault.jpg", sort_order: 233},
  {video_id: "mEiFVeS_6ck", title: "Disaster Recovery in oVirt - FOSSAsia 2015", published_at: "2015-03-15 12:22:48", description: "Speaker: Maor Lipchuk, Red Hat\n\nDescription:\nEven the best system administrator cannot always avoids any and\nevery disaster that may plague his data center, but he should have a\ncontingency plan to recover from one - and an administrator that\nmanages his virtual data centers with oVirt is of course no different.\nThis session will cover the new features introduced in oVirt 3.5.0 to\nhandle such scenarios and will showcase how stringing together a set\nof building blocks can produce a well rounded solution for disaster\nscenarios.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/mEiFVeS_6ck/default.jpg", image2: "https://i.ytimg.com/vi/mEiFVeS_6ck/mqdefault.jpg", image3: "https://i.ytimg.com/vi/mEiFVeS_6ck/hqdefault.jpg", sort_order: 241},
  {video_id: "ltqbEp23f5w", title: "PostgreSQL 9.4 and Beyond - FOSSAsia 2015", published_at: "2015-03-15 12:23:05", description: "Speaker: Satoshi Nagayasu Japan PostgreSQL Users Group / Uptime Technologies\n\nDescription:\nRecently, PostgreSQL has succeeded in getting popularity among\nweb developers. One of the reasons is that PostgreSQL is growing\nnot only as a traditional RDBMS, but also as an application\ndevelopment platform with fully supporting ACID properties. In this\ntalk, I would like to introduce new features in the latest release 9.4\n(JSON, Analytics, Logical Decoding, etc.) to take advantages of the\nlatest PostgreSQL advancement, and share a quick look in the\nupcoming release 9.5.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/ltqbEp23f5w/default.jpg", image2: "https://i.ytimg.com/vi/ltqbEp23f5w/mqdefault.jpg", image3: "https://i.ytimg.com/vi/ltqbEp23f5w/hqdefault.jpg", sort_order: 240},
  {video_id: "C-6popLVbco", title: "Analysing your CDN usage- FOSSAsia 2015", published_at: "2015-03-15 12:23:19", description: "Speaker: Piyush Verma, Simversity Inc \n\nDescription:\nCDNlysis syncs Amazon Cloudfront logs, which are stored as compressed files in S3 bucket and streams them to InfluxDB, a time\nseries Database with a powerful Querying API. CDNlysis is designed\nto work on millions and millions of records and as-it-happens updates\nof the CDN usage. You use this for: Understanding how the Bandwidth is being used. Finding out the most popular and most downloadable content. Generate trends for your most popular Videos, Audios, Slides etc. Understand geographical behaviour of the Requests. Amount of Bytes transferred to & fro the Cloudfront distributions. Find out the most profitable referrer from where your content is being accessed. etc.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/C-6popLVbco/default.jpg", image2: "https://i.ytimg.com/vi/C-6popLVbco/mqdefault.jpg", image3: "https://i.ytimg.com/vi/C-6popLVbco/hqdefault.jpg", sort_order: 239},
  {video_id: "-1Hjh0SaZXo", title: "MySQL Cluster as Transactional NoSQL - FOSSAsia 2015", published_at: "2015-03-15 12:23:33", description: "Speaker: Ryusuke Kajiyama, Oracle Corporation Japan\n\nDescription:\nThere’s a lot of excitement around NoSQL Data Stores with the\npromise of simple access patterns, flexible schemas, scalability and\nHigh Availability. The downside comes in the form of losing ACID\ntransactions, consistency, flexible queries and data integrity checks.\nWhat if you could have the best of both worlds? This session shows\nhow MySQL Cluster provides simultaneous SQL and native NoSQL\naccess to your data – whether a simple key-value API (Memcached),\nREST, JavaScript, Java or C++. You will hear how the MySQL\nCluster architecture delivers in-memory real-time performance,\n99.999% availability, on-line maintenance and linear, horizontal\nscalability through transparent auto-sharding.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/-1Hjh0SaZXo/default.jpg", image2: "https://i.ytimg.com/vi/-1Hjh0SaZXo/mqdefault.jpg", image3: "https://i.ytimg.com/vi/-1Hjh0SaZXo/hqdefault.jpg", sort_order: 238},
  {video_id: "tF8t47U-eww", title: "Never build a login again : The art of using Social Auth with Django - FOSSAsia 2015", published_at: "2015-03-14 07:21:12", description: "Speaker:  Nikunj Thakkar, Ishi Systems\n\nDescription:\nIn era of Agile software development, wasting time behind building user management functionalities is a bit overhead. In addition to that there are security concerns for storing crucial information about users. Users trust giants and so we. There are plenty of use cases where products fails just because they are unable to attract users.\n\n- Effectively using Social Auth with Django\n- Saving your time during rapid development using Social Auth and Django\n- Delegating authentication responsibilities to Social Auth providers\n- As easy as 1,2,3 : Actual power of batteries included framework\n- A quick demo\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/tF8t47U-eww/default.jpg", image2: "https://i.ytimg.com/vi/tF8t47U-eww/mqdefault.jpg", image3: "https://i.ytimg.com/vi/tF8t47U-eww/hqdefault.jpg", sort_order: 247},
  {video_id: "VEIr8osDM78", title: "How to setup web scalable architecture with MySQL Fabric - FOSSAsia 2015", published_at: "2015-03-14 08:14:38", description: "Speaker: Ricky Setyawan, MySQL\n\nDescription:\nMySQL fabric is a tool that was launched as part of MySQL Utilities 1.4. Fabric is written in Python and includes a special library that implements all the functionalities provided. It seeks to make horizontal scale-out through sharding more accessible to users with growing data management requirements. This integrated framework supports management of large farms of MySQL servers, and includes support for sharding and highavailability. In this session, we will share how to setup a scalable web architecture with fabric.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/VEIr8osDM78/default.jpg", image2: "https://i.ytimg.com/vi/VEIr8osDM78/mqdefault.jpg", image3: "https://i.ytimg.com/vi/VEIr8osDM78/hqdefault.jpg", sort_order: 245},
  {video_id: "JMopVJ2mfok", title: "Hackatron Asia: About WatchKit", published_at: "2014-12-07 06:31:26", description: "Presented at Hackatron Asia 2014 (http://hackatron.techinasia.com)\n\nSpeaker: Subhransu Behera, founder of iOS Dev Scout\n\nThe iOS Dev Scout user group was founded to encourage engagement and interaction amongst iOS developers, get updated about latest iOS technologies through monthly meetups, coffee break sessions, get informed about career opportunities and build some amazing iOS apps together.\nThis session will see you learning about WatchKit and what you can do with it.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/JMopVJ2mfok/default.jpg", image2: "https://i.ytimg.com/vi/JMopVJ2mfok/mqdefault.jpg", image3: "https://i.ytimg.com/vi/JMopVJ2mfok/hqdefault.jpg", sort_order: 266},
  {video_id: "icUdc1H8PHs", title: "Hackatron Asia: Breakout Session by PayPal and Braintree", published_at: "2014-12-07 06:31:41", description: "Presented at Hackatron Asia 2014 (http://hackatron.techinasia.com)\n\nLearn how to integrate with PayPal & Braintree payments with just a snippet of code! Within minutes, you can enable your app to accept payments made through credit cards, debit cards, PayPal and Apple Pay. Join us for a quick introduction to the APIs and a live demo!\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/icUdc1H8PHs/default.jpg", image2: "https://i.ytimg.com/vi/icUdc1H8PHs/mqdefault.jpg", image3: "https://i.ytimg.com/vi/icUdc1H8PHs/hqdefault.jpg", sort_order: 267},
  {video_id: "dHVzym9IXC8", title: "Hackatron Asia: Show & Tell by Singapore Gophers", published_at: "2014-12-07 06:32:42", description: "Presented at Hackatron Asia 2014 (http://hackatron.techinasia.com)\n\nSpeaker:  Lakshan Perera, founder of Singapore Gophers\n\nGo is an open source programming language that makes it easy to build simple, reliable, and efficient software. It was developed at Google in 2007.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/dHVzym9IXC8/default.jpg", image2: "https://i.ytimg.com/vi/dHVzym9IXC8/mqdefault.jpg", image3: "https://i.ytimg.com/vi/dHVzym9IXC8/hqdefault.jpg", sort_order: 271},
  {video_id: "39DbhIAWTGc", title: "Money, Sex and Evolution by Chang Sau Sheong", published_at: "2014-10-30 15:39:27", description: "This talk was recorded at GeekCampSG 2014 on 18th October 2014.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/39DbhIAWTGc/default.jpg", image2: "https://i.ytimg.com/vi/39DbhIAWTGc/mqdefault.jpg", image3: "https://i.ytimg.com/vi/39DbhIAWTGc/hqdefault.jpg", sort_order: 303},
  {video_id: "TYTAZWbMusM", title: "Modify UI with/out Source Code by Prof Zhao", published_at: "2014-10-30 15:39:27", description: "This talk was recorded at GeekCampSG 2014 on 18th October 2014.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/TYTAZWbMusM/default.jpg", image2: "https://i.ytimg.com/vi/TYTAZWbMusM/mqdefault.jpg", image3: "https://i.ytimg.com/vi/TYTAZWbMusM/hqdefault.jpg", sort_order: 300},
  {video_id: "qEGk_4TGGIM", title: "Why HTML5 Doesn't Work for Mobile Apps by Subhransu Behera", published_at: "2014-10-30 15:39:27", description: "This talk was recorded at GeekCampSG 2014 on 18th October 2014.\n\nVisit http://geekcamp.sg for more information about the event", image1: "https://i.ytimg.com/vi/qEGk_4TGGIM/default.jpg", image2: "https://i.ytimg.com/vi/qEGk_4TGGIM/mqdefault.jpg", image3: "https://i.ytimg.com/vi/qEGk_4TGGIM/hqdefault.jpg", sort_order: 298},
  {video_id: "_1xLtK1g5u8", title: "ExpEYES: Python Powered Open Source Pocket Science Lab - FOSSAsia 2015", published_at: "2015-03-14 06:33:24", description: "Speaker: Praveen Patil, ExpEYES\n\nDescription:\nExpEYES (Experiments for Young Engineers and Scientists) is an Open Hardware and Free Software framework for developing science experiments, classroom demonstrations and projects and is from the PHOENIX project of Inter-University Accelerator Centre, New Delhi. ExpEYES brings the ability to perform experiments with reasonable accuracy and opens up an entirely new path for learning science. It aims at providing thousands of students and young scientists with an open source, low-cost lab in their pocket. Design of ExpEYES combines the real-time measurement capability of microcontrollers with the ease and flexibility of Python programming language for data analysis and visualization. http://www.expeyes.in In the presentation I will be giving detailed information about how python can be used to easily communicate with the ExpEYES hardware. Also the fact\nthat Python made it so easy that even a beginner can write simple python code to fetch data from the interface to perform various experiments and plot it with very few lines of python. Flexibility of Python programming language has brought us close to our dream of providing children with the most affordable and easy to handle pocket science lab.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/_1xLtK1g5u8/default.jpg", image2: "https://i.ytimg.com/vi/_1xLtK1g5u8/mqdefault.jpg", image3: "https://i.ytimg.com/vi/_1xLtK1g5u8/hqdefault.jpg", sort_order: 250},
  {video_id: "DKD1PiLA4bg", title: "Enabling Cyber Physical systems using Beaglebone Black and Python - FOSSAsia 2015", published_at: "2015-03-14 07:20:37", description: "Speaker:  Deepak Karki, PES Institute of Technology\n\nDescription:\nI will be covering the developer tools available to build cyber physical\nsystems using opensource hardware and software (in this case, the\nBeaglebone Black and the Python programming language). The talk will cover 3 main tools available to the developer community.\n\n1. PyBBIO - Beaglebone IO using python. I'm a co-author for this project.\n\nLink : https://github.com/alexanderhiam/PyBBIO\n\n2. PRUSepak - Real time control using the PRU remote-processors on the Beaglebone Black. I'm the primary author for this project.\n\nLink : https://github.com/deepakkarki/pruspeak\n\n3. Project Zygote - A IoT framework centered around the Beaglebone Black.\nWritten using Flask, a python based web framework. I'm the primary author for this project.\n\nLink : https://github.com/kres/zygot\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/DKD1PiLA4bg/default.jpg", image2: "https://i.ytimg.com/vi/DKD1PiLA4bg/mqdefault.jpg", image3: "https://i.ytimg.com/vi/DKD1PiLA4bg/hqdefault.jpg", sort_order: 248},
  {video_id: "IqveSlOzjcU", title: "Deploying OpenNebula, the Open Source Solution for Enterprise Cloud Solution - FOSSAsia 2015", published_at: "2015-03-15 12:22:28", description: "Speaker: Goh Choon Ming, OlinData\n\nDescription:\nAs enterprises expand their datacenters or internal infrastructure, it is\nvery common for one to use commercial software such as VMWare or\nOSS solution such as Xen, KVM or OpenStack. However, the reality\nis that enterprises chose commercial products in the end because of\nthe features made available to them. An open source\ncloud/infrastructure solution such as OpenNebula provides the\nfeatures that can rivals VMWare whilst integrating with various other\nopen source technologies will balance up the scale. The talk will show\nyou how OpenNebula works and what are the features available and\nhow it integrates with other Open Source solution in order to rival\nVMWare or other commercial products.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/IqveSlOzjcU/default.jpg", image2: "https://i.ytimg.com/vi/IqveSlOzjcU/mqdefault.jpg", image3: "https://i.ytimg.com/vi/IqveSlOzjcU/hqdefault.jpg", sort_order: 242},
  {video_id: "jiLINn2NaUg", title: "10 Features your Developers are missing when 'Stuck' with proprietary database! - FOSSAsia 2015", published_at: "2015-03-15 12:23:47", description: "Speaker: Sameer Kumar, Ashnik Pte Ltd \n\nDescription:\nDatabase is core of any enterprise project. Be it the solution which a\nbank relies on for daily transactions or be the software which helps\nyour mobile operator track your usage and send you a bill. Every\napplication needs a data store and that is why every developer\nsooner or later has to be exposed to databases. I have seen mostly\nwhen I talk to developers about a database or relational database\nthere are a few or rather just a name that would pop-up in their head.\nProprietary databases have become so much a synonym to the term\n\"RDBMS\" that developer today hardly know about any other\ndatabase. In this talk I will discuss about 10 such great features which\nyour developers are missing if they are still stuck with Proprietary\nDatabase. I will be discussing 10 awesome features of PostgreSQLWorlds\nmost Advanced Open Source Database.\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/jiLINn2NaUg/default.jpg", image2: "https://i.ytimg.com/vi/jiLINn2NaUg/mqdefault.jpg", image3: "https://i.ytimg.com/vi/jiLINn2NaUg/hqdefault.jpg", sort_order: 237},
  {video_id: "-FHW0MbZ5xM", title: "Hackatron Asia: Throw out those Servers, Bring in the Cloud!", published_at: "2014-12-07 06:31:57", description: "Presented at Hackatron Asia 2014 (http://hackatron.techinasia.com)\n\nHosted by SoftLayer\n\nOne of the biggest challenges for startups, no matter how brilliant the idea or, how innovative the app, is dealing with the technical side of business. Not only are you expected to get that out-of-the-box idea, plan for it, seek investors for it but you also have to seek the right technical infrastructure to take it to the masses. Well, who says you have to be technical to get that business off the ground. With everything on the cloud all you need to know about IT systems is click, point, order – and hey presto, your systems are up and running in minutes and hours, not days and months!\n\nAttend the cloud workshop where the speaker shows how you can build your own cloud in minutes and get access to the latest technologies without having to empty out your pockets. Also, hear stories of startups from Indonesia, Asia and the globe who have built their businesses on the cloud and rapidly grown to cater to their consumer demands\n\nProduced by Engineers.SG", image1: "https://i.ytimg.com/vi/-FHW0MbZ5xM/default.jpg", image2: "https://i.ytimg.com/vi/-FHW0MbZ5xM/mqdefault.jpg", image3: "https://i.ytimg.com/vi/-FHW0MbZ5xM/hqdefault.jpg", sort_order: 268}
])
