  {title: "AWS User Group Singapore", description: "A group of Amazon Web Services users in Singapore. We meet every month to talk about technology, and how we build things.\r\n\r\nWe gather people working with lots of different technologies that take advantage of cloud solutions.", website: "http://www.meetup.com/AWS-SG/", twitter: "", contact_person: "Alex Smith", active: true, image: "http://photos1.meetupstatic.com/photos/event/4/c/1/0/global_338779472.jpeg"},
