  {title: "Singapore PHP User Group", description: "Welcome to the Singapore PHP User Group. The current group was founded on Dec 28, 2006. Our inaugural meetup was held on January 11, 2007 at Brewerkz. A grand total of 7 people RSVPed (about 5 showed up) (http://www.meetup.com/sgphpug/events/5349671/). The meetup really took off after we moved to Facebook in Nov 2007. Our first event on Facebook (https://www.facebook.com/events/6089200921/) was filled to capacity at the SMU seminar room. \r\n\r\nPHP (recursive acronym for \"PHP: Hypertext Preprocessor\") is a widely-used Open Source general-purpose scripting language that is especially suited for Web development and can be embedded into HTML.\r\n\r\nJoin us today!", website: "http://phpug.sg", twitter: "phpsingapore", contact_person: "Michael Cheng", active: true, image: "https://pbs.twimg.com/profile_images/593598457736077312/i3YmDn_o.jpg"},
  {title: "Singapore Spring User Group", description: "A Singapore-based Spring user group (SingaSUG) focused on helping Spring users share experiences, problems and solutions, as well as learn new skills, promote the adoption, and general discussion around Spring Framework, use of software development best practices and related technologies.\r\n\r\nSingaSUG is a meetup for Software Developers about Spring Framework and Open-source technologies. Everyone is most welcome to this new group. Meetups will be on a monthly basis first Thursday of the month. \r\nJoin our discussions and announcements at http://singasug.com.", website: "http://singasug.com", twitter: "", contact_person: "Sergiu Bodiu", active: true, image: "http://photos1.meetupstatic.com/photos/event/9/d/a/3/global_437440355.jpeg"},
  {title: "SingaporeJS", description: "Developers interested in sharing knowledge and growing their skills around JavaScript and modern web technology: e.g. ES6, AltJS, NodeJS, Angular, Ember, Browserify, Web Components, HTML5 APIs, LevelDB, etc.\r\n\r\n\r\nGoals\r\n\r\nA monthly meetup\r\n\r\nPost-meetup meals/drinks for socialising.\r\n\r\nPrefer many short talks vs. few long talks.\r\n\r\nFocus on cutting-edge technologies and development techniques.\r\n\r\nFocus on open source over commercial products.\r\n\r\nFocus on clean code.\r\n\r\n\r\nIf you want to help out, sponsor, or have any suggestions or feedback, just get in touch!", website: "http://www.meetup.com/Singapore-JS/", twitter: "", contact_person: "", active: true, image: "http://photos4.meetupstatic.com/photos/event/b/4/4/1/highres_436066145.jpeg"},
